INSERT INTO `tb_event` (`id`, `kode_event`, `nama`, `deskripsi`, `lokasi`, `waktu_mulai`, `waktu_selesai`, `tgl_buka`, `tgl_tutup`, `harga`, `foto`, `link_video`, `kapasitas_awal`, `kapasitas_akhir`, `status`, `kategorievent_id`, `created_at`, `updated_at`, `user_id`) VALUES
(1, 'EK0001', 'Pameran Wayang', 'Pameran yang memamerkan berbagai jenis wayang mulai dari wayang kulit, wayang golek, serta wayang suket (rumput) tersebut sebagai bentuk upaya untuk menjaga tradisi dan kebudayaan Indonesia dengan cara menampilkan wayang kepada masyarakat luas terutama generasi milennial dan generasi Z dengan kemasan yang menarik dan relevan dengan fenomena yang dihadapi saat ini.', 'Watu Gambir', '09:00', '15:00', '2022-08-21', '2022-08-21', '5000', '2jTi9l9dCxzrleAdQimhmIWicsuqhg1ES7kvfK9h.jpg', 'https://www.youtube.com/embed/L0MK7qz13bU', 100, 5, 1, 5, '2022-08-21 03:35:13', '2022-12-01 08:00:21', 7),
(2, 'EK0002', 'Pameran Seni ISI Surakarta', 'lorem ipsum............................................', 'Watu Gambir', '12:00', '15:00', '2022-09-02', '2022-09-02', '5000', 'VnSyM8vqjygBB3yTFau3iNgCJAvBD98w9UemrUw5.jpg', 'https://www.youtube.com/embed/L0MK7qz13bU', 100, 2, 0, 5, '2022-09-02 02:31:45', '2022-09-02 02:43:38', 7),
(3, 'EK0003', 'Pelatihan Barista', 'Dinas pemberdayaan masyarakat desa Provinsi Jawa Timur mengadakan kegiatan Kegiatan Pemberdayaan Ekonomi Masyarakat SINANDO (Sinau Nang Ndeso) di Sekar Wilis Resto Desa Kare. Kegiatan tersebut diikuti oleh 30 peserta dari berbagai komunitas penggiat usaha kopi dan juga wisata di kawasan Kabupaten Madiun. Pemateri dalam kegiatan tersebut bekerjasama dengan Universitas Brawijaya Surabaya, dimana output yang diharapkan dari kegiatan tersebut, yaitu peserta bisa sharing usaha sekaligus berkreasi meningkatkan skill khususnya dalam bidang barista, sehingga produksi kopi di Kabupaten Madiun bisa naik kelas.', 'Sekar Wilis Resto', '08:00', '16:00', '2023-01-29', '2023-01-29', '5000', 'plGBBpnS9aOhsxG6WC970cFBcAgJAZCBftzAxzPv.jpg', NULL, 30, 21, 1, 7, '2022-10-19 05:46:52', '2023-01-11 06:36:29', 105),
(9, 'EK0008', 'Kesenian Ganong dan Jathilan', 'Salah satu kesenian khas Daerah Ponorogo juga dikembangkan di Desa Kare. Sanggar Seni Singo Mudho Manunggal salah satu sanggar yang menjadi tempat dikembangkannya Seni Ganong, Jathilan, dan Reog Ponorogo yang dikelola oleh Pak Dicky. Sebelum sanggar ini berdiri Pak Dicky melatih di TK Kare dan mengikuti paguyuban seni reog, karena lama kelamaan paguyuban itu sepi karena orang-orang mulai menghilang akhirnya beliau bertekat untuk membangun sanggar sendiri. Anggota sanggar ini adalah anak-anak usia 5 tahun sampai 11 tahun baik di Desa Kare maupun luar Desa Kare. Namun sanggar ini masih belum memiliki dadak merak sehingga saat ada job event beliau menyewa dari luar Daerah Madiun.', 'Desa Kare, Madiun', '15:00', '17:00', '2023-02-26', '2023-02-26', '0', 't2oktnjkHmDjleTCtOZLrFhMGyZT7jpahu0BdUan.jpg', NULL, 1000, 17, 1, 2, '2022-11-28 08:01:14', '2023-02-22 08:43:25', 105),
(10, 'EK0009', 'Kesenian Dongkrek', 'Dongkrek Enggal Budoyo Desa Kare yang diketuai oleh Bapak Bardi, dongkrek sendiri meruoakan kesenian dan kebudayaan asli dari Kabupaten Madiun. Asal usul nama dongkrek adalah pada zaman dahulu gamelan hanya terdiri dari dong yang dipukul akan berbunyi dong dan alat musik bernama krek yang mengeluarkan suara krek, jadilah nama dongkrek.Dongkrek bisa ditemukan di Daerah Gonalan dan Wijayan. Kesenian ini dirintis oleh nenek moyang pada tahun 1950-an dan mulai berdiri secara resmi pada tahun 1968. Bapak Bardi sendiri mulai merintis di Desa Kare pada tahun 2017 hingga sekarang, dengan anggota para sepuh yang ada di Desa Kare namun sekarang sudah dikembangankan menjadi extrakulikuer di sekolah dasar yang ada di Desa Kare. Anggota dongkrek sendiri ada 14 orang (termasuk penari) ditambah sinden, para penari mengenakan topeng yang terbuat dari kayu dengan berbagai macam bentuk karakter.', 'Desa Kare,Madiun', '13:00', '15:00', '2023-01-21', '2023-01-21', '0', 'h0yreOHcZpE2iow4Itow6rEhUqgmiS45BmwMzeQI.jpg', NULL, 500, 14, 1, 2, '2022-11-28 08:07:35', '2023-01-11 06:34:26', 105),
(11, 'EK0010', 'Kesenian Caplokan', 'Salah satu kesenian yang berada di Madiun adalah caplokan, Di Desa Kare Madiun menjadi tempat yang masih melestarikan kebudayaan caplokan, salah satunya Sanggar Caplokan Ronggo Wilis Saputro yang dikelola langsung oleh Pak Bini. Sanggar ini sudah ada dari tahun 970 karena peralatan sudah tidak memadai akhirnya berhenti. Pada Tahun 2012 Pak Bini mendapatkan anggaran dari pemerintah setempat, akhirnya kembali aktif lagi. Anggota sanggar ini adalah pemuda yang ada di Desa Kare dan sekitarnya, salah satu contoh untuk melestarikan kebudayaan dengan mengajarkan kesenian kepada generasi muda. Caplokan biasanya ditampilkan saat acara-acara besar dan pagelaran budaya. Caplokan yang di kelola oleh Pak Bini pernah tampil dalam kejuaraan seni tingkat provinsi dan mendapatkan juara 2.', 'Desa Kare, Madiun', '08:10', '11:45', '2023-02-01', '2023-02-01', '0', 'iRv3WRWj6joBIFs2kqnBYf2Iaw16qClAHhwkbOzg.jpg', NULL, 750, 54, 1, 2, '2022-11-28 08:18:13', '2023-01-11 02:00:15', 105),
(13, 'EK0011', 'konser', 'konser', 'kare', '15:30', '18:30', '2023-01-13', '2023-01-13', '0', 'gWWtikRoUd3kF9jmtQdYVG1CMYL104uMuJqiJbvO.jpg', NULL, 100, 0, 1, 4, '2023-01-11 05:09:59', '2023-01-11 05:11:59', 340);
INSERT INTO `tb_hotel` (`id`, `tempat_id`, `user_id`, `kode_hotel`, `nama`, `deskripsi`, `lokasi`, `telp`, `foto`, `status`, `slug`, `created_at`, `updated_at`) VALUES
(14, '74', '257', 'HT0012', 'Aston Madiun Hotel', 'Berjarak hanya 4 menit berkendara dari Alun-Alun Kota Madiun, Aston Madiun Hotel & Conference Center adalah hotel bintang 4 yang elegan dengan kolam renang, pusat kebugaran, dan fasilitas spa. Parkir umum di tempat gratis untuk tamu hotel dan internet kabel tersedia di semua area umum. \r\n\r\nDihiasi dengan bunga lili dan perabotan berwarna gelap, kamar-kamar ber-AC-nya dilengkapi dengan minibar, area tempat duduk, dan TV kabel layar datar. Setiap kamar juga memiliki meja dan fasilitas membuat kopi/teh. Kamar mandi pribadinya menyediakan pengering rambut, handuk, dan perlengkapan mandi gratis. \r\n\r\nMenyajikan makanan Indonesia, Asia, dan Amerika, H & E Restaurant menawarkan sarapan prasmanan, hidangan a la carte sepanjang hari, dan layanan kamar. Anda dapat menggunakan fasilitas barbekyu, sedangkan makanan anak-anak tersedia dengan biaya tambahan. Para tamu dapat menikmati koktail setelah makan di bar, serta minuman berbasis espresso di kedai kopi.\r\n\r\nMengoperasikan meja depan 24 jam, hotel ini dengan bangga menawarkan fasilitas rapat dan layanan pramutamu. Anda dapat menggunakan penyimpanan bagasi, ATM di tempat, dan layanan binatu. Para tamu yang menginap dapat berjalan-jalan santai di taman. \r\n\r\nAston Madiun Hotel & Conference Center berjarak 2,8 km dari Plaza Madiun dan 2,1 km dari Taman Bantaran Kali Madiun, sedangkan Bunderan Serayu Taman Kota Madiun berjarak 6 menit berkendara dari hotel. Bandara Internasional Adi Soemarmo berjarak 121 km dan Anda dapat mengatur antar-jemput bandara berbayar dengan properti.', 'https://goo.gl/maps/Gs9mJpDBVLFXA7a39', '0987654321', 'DhJcMSPNVx0AVQMSbnx2PXg7eSD8RlCP07qtrPCM.jpg', 1, 'aston-madiun-hotel', '2022-11-29 13:57:18', '2022-11-29 13:57:18'),
(15, '79', '262', 'HT0013', 'Amaris Hotel Madiun', 'Madiun mungkin hanya kota kecil di Jawa Timur, tetapi, siapa sangka kota ini menyimpan banyak destinasi menarik. Melihat banyaknya wisatawan mencari alternatif destinasi wisata yang berbeda di Jawa Timur, Amaris Hotel Madiun hadir untuk memberikan akomodasi yang sesuai dengan kebutuhan. Amaris Hotel Madiun memberikan pilihan yang terjangkau dan tentu tidak melupakan kenyamanan dan keramahan pelayanannya.', 'Jl. Kalimantan No.30, Kartoharjo, Kec. Kartoharjo, Kota Madiun, Jawa Timur 63116', '03514472525', 'tUf1xQaPAybCHogkTeqosH6J4sQKM95lcYSHdm8m.jpg', 1, 'amaris-hotel-madiun', '2022-11-30 06:15:17', '2022-11-30 06:15:17'),
(16, '78', '261', 'HT0014', 'Fave Hotel Madiun', 'Favehotel Madiun terdiri dari 60 kamar Superior yang baru dan modern, berukuran 18 m2 yang tersedia dengan ruangan merokok dan tidak merokok. Semua kamar dilengkapi televisi layar datar 32 inch, dengan 40 channel lokal dan internasional. Ruangan dilengkapi dengan pendingin udara, kamar mandi dengan desain menarik .', 'Jln Mayjend Sungkono No 43 Madiun, East Java, 63128', '089652101019', 'XKpTlY8n0S8HbbBwx4fOVJdRYH7PKBJJAedeaTS1.jpg', 1, 'fave-hotel-madiun', '2022-11-30 06:33:02', '2022-11-30 06:42:38'),
(17, '75', '258', 'HT0015', 'The Sun Hotel', 'Sun Hotel Madiun berlokasi di pusat Kota Madiun. Hanya 5 menit dari terminal bis dan stasiun kereta api. Sun Hotel memiliki akses dekat dengan berbagai lokasi penting, seperti kantor Pemerintah, Pusat Kuliner, Tempat Wisata. Sun Hotel terletak di satu kawasan yang bersebelahan dengan Suncity Mall dan Suncity Waterpark. Semua fasilitas hanya untuk pribadi istimewa seperti Anda.', 'Kawasan Bisnis dan Rekreasi Suncity Festival Jl. Let.Jend. S Parman No. 8 Kec. Kel, Rejomulyo, Kec. Kartoharjo, Kota Madiun, Jawa Timur 63111', '0987654321', 'UXlpjLEn5JwngnCrWnQTUEa42jtYIGZPmIIW67ZB.png', 1, 'the-sun-hotel', '2022-11-30 06:40:26', '2022-11-30 06:45:14'),
(18, '70', '247', 'HT0016', 'Hotel Setia Budi Madiun', 'Fasilitas Kamar\r\nAC\r\nAir minum kemasan cuma-cuma\r\nPembuat kopi / teh\r\nTelevisi\r\nDesk\r\nBlackout drapes / curtains\r\n\r\nPerlengkapan Kamar Mandi\r\nAir panas\r\nKamar mandi pribadi\r\nShower\r\nToiletries', 'Jalan Mangga No. 4, Taman, Madiun, Jawa Timur, Indonesia, 63132', '081908294848', 'zp22P02Y1v0YT9cfCaeT3yZ4jVFmai5Dzo1xJkmD.png', 1, 'hotel-setia-budi-madiun', '2022-11-30 08:46:17', '2022-12-01 00:25:56'),
(19, '83', '266', 'HT0017', 'Hotel Kartika Abadi', 'Hotel di pusat kota Madiun dengan letak strategis dan harga terjangkau dilengkapi dengan spot foto yang aesthetic dan instagramable', 'Jl. Pahlawan No.54, Pangongangan, Manguharjo, Madiun', '081230300212', 'oiIC6ajbh3nxJDMUkNwAOhXDZS0KzsUfbxJAR6mz.jpg', 1, 'votel-kartika-abadi', '2022-12-01 00:51:48', '2022-12-01 00:51:48'),
(20, '84', '267', 'HT0018', 'Guest House Eboni', 'Guest House Eboni Madiun menawarkan akomodasi di Batu, Malang dan berjarak sejauh 82 meter dari Taman Trembesi Kota Madiun. Properti ini memiliki kolam renang.\r\n\r\nSetiap kamar dilengkapi dengan kasur yang nyaman dan bantal. Shower tersedia di kamar mandi.\r\n\r\nTamu dapat menikmati makanan di d\'Arboretum. Pilihan tempat makan lain juga tersedia di sekitar properti.\r\n\r\nFasilitas lain di Guest House Eboni Madiun adalah ruang tamu.\r\n\r\nGuest House Eboni Madiun terletak 1,8 km dari Suncity Mall Madiun dan 1,8 km dari Dumilah Water Park. Stasiun kereta api terdekat adalah Stasiun Kereta Api Madiun, 1,8 km dari properti. Bandara terdekat adalah Bandar Udara Internasional Adisumarmo, 116  km dari properti.', 'Jl. Rimba Mulya No.11, Kartoharjo, Kota Madiun', '087855859343', 'PmFswak5iwNmuO5eTX26JizHNHKPhbEMNjEbwhxq.jpg', 1, 'guest-house-eboni', '2022-12-01 02:59:34', '2022-12-01 03:06:20'),
(21, '85', '269', 'HT0019', 'Hotel Merdeka Madiun', 'Hotel Bersejarah bintang 3 yang berada di pusat Kota Madiun', 'https://goo.gl/maps/azo4aWY1MANUCwPJA', '08123456789', 'anxqYvmhL1Lv03ayJbuW7YwAjzLgrbbUIm75NWIs.png', 1, 'hotel-merdeka-madiun', '2022-12-01 03:20:47', '2022-12-01 03:20:47'),
(22, '87', '272', 'HT0020', 'Hotel Kharisma Madiun', 'Hotel | Meeting Room | Convention Center\r\nFor any inquiries, please contact us :', 'https://goo.gl/maps/spkLZwNDS1ooXeff9', '62351456708', 'W5Bg4KhXkoiRHsoyp5YTM6rccbC92YMpa9RAnwCb.jpg', 1, 'hotel-kharisma-madiun', '2022-12-01 03:41:18', '2022-12-01 03:41:18'),
(23, '88', '274', 'HT0021', 'Kali Catur Syariah Hotel', 'Kali Catur Syariah Hotel menawarkan penginapan modern di Madiun dengan jarak 10 menit berkendara dari Alun-Alun Kota Madiun. Selama menginap, kamu bisa menikmati fasilitas restoran, kolam renang outdoor, dan fasilitas rapat. Kamu juga bisa  menikmati akses WiFi gratis yang tersedia di seluruh area hotel. \r\n\r\nMenyuguhkan arsitektur Jawa tradisional dengan aksen kayu, kamar ber-AC di Kali Catur Syariah Hotel menyediakan ruangan yang nyaman untuk bersantai, serta dilengkapi dengan TV layar datar, area tempat duduk, dan jendela yang menghadap ke pemandangan halaman hotel. Di kamar mandi dalamnya terdapat shower air panas dan dingin, handuk, dan peralatan mandi gratis. Hotel ini juga menyediakan beberapa kamar dengan ruangan yang lebih luas untuk kenyamananmu.', 'https://goo.gl/maps/xUMiB7YeRwUB74kf6', '081234567891', '0ikxVMzFur4zRcx29cds36c8se6bMG6xadEKoJqc.png', 1, 'kali-catur-syariah-hotel', '2022-12-01 04:08:07', '2022-12-01 04:08:07'),
(24, '59', '208', 'HT0022', 'Homestay Desa Kare', 'Homestay di desa Kare', 'Desa Madiun', '08123456789', '5bniMNl4BvQYGjGwVz00uwDAMcH3u4ZbWYOGeNWq.jpg', 1, 'homestay-desa-kare', '2022-12-01 04:46:55', '2022-12-01 04:46:55'),
(25, '90', '293', 'HT0023', 'Hotel Setia Budi Madiun', '  &  :\r\n HOTEL SETIA BUDI\r\n Telepon :\r\n (0351) 464406 Ext. 125\r\n Atau melalui Whatshapp :\r\n0819 0829 4848', 'Jalan Mangga No.4 Kota Madiun, Jawa Timur', '081234556788', 'ZKHn0l3cwwH15rqZPB8FVOJzVSsjmFTQrE9dJyk5.png', 1, 'hotel-setia-budi-madiun', '2022-12-19 06:16:32', '2022-12-19 06:16:32');
