(21, 15, 79, 'SMART ROOM QUEEN', 'tdmhGSaOXE8qR9rMau1EseW7s388fd7ZmqAvbVqG.png', '450000', 2, 'standard', 'Smart Room Queen kami dilengkapi dengan berbagai fasilitas seperti AC, LED TV dengan saluran TV kabel, dan WiFi gratis! Sebuah meja kerja juga disertakan untuk mendukung kebutuhan bisnis Anda, dan sarapan gratis selama Anda tinggal.', 'Max Occ:3 persons(2adults&1child)\r\n18 SQM\r\nWorking Desk\r\nQueen Size Bed\r\nFree WiFi\r\nNon/Smoking Room Available\r\nNo Extra Bed allowed', 1, 0, 'K019', '2022-11-30 06:21:03', '2022-11-30 06:23:53'),
(22, 14, 74, 'Superior', 'W9gHO0eL6xdaWO6WEVTeFtH1IEb0GQYI8AUevRAY.jpg', '576000', 2, 'standard', 'Fasilitas Kamar :1. AC2. Minibar3. Televisi4. Desk5. Brankas dalam kamar', 'Harga /kamar/malam', 1, 0, 'K019', '2022-11-30 06:21:56', '2022-11-30 06:28:39'),
