(26, 16, 78, 'SUPERIOR KING', 'QbiRowkYKFMdns85UpPypHPXDj4sjeiH5tZcxE6x.png', '400000', 2, 'standard', 'Kamar seluas 21 meter persegi dengan desain bergaya modern, mewakili merek favehotel, sekarang hadir di Madiun untuk mengakomodasi Anda. Nikmati kenyamanan kamar yang memberi Anda kualitas tidur maksimal. Tetap terhubung dengan koneksi internet nirkabel kecepatan tinggi kami.', 'Fasilitas di dalam kamar IDD telephone, brankas, mesin pembuat kopi dan teh dan ada beberapa kamar    yang tersedia balkon.', 1, 0, 'K022', '2022-11-30 06:37:03', '2022-11-30 06:40:00'),
