(54, 11, 'Teh Hangat', 'mENx1PMkElunxONoxYpSGGRu9Y11Hm5ah2sebJhW.jpg', 4000, 'Teh yang diseduh dengan air hangat ditambah dengan gula menambah kenikmatan rasa . Diminum disaat keadaan hangat di cuaca yang dingin .', 1, 'K052', 'minum', '2022-10-25 05:44:39', '2022-10-25 05:44:39'),
(55, 11, 'Es teh', 'oudoaeMdhlG7ZX9UTytYiURa9Uh6O5en1NwABV9F.jpg', 4000, 'Teh yang didinginkan dengan es batu. Es teh sering kali ditambahkan rasa seperti melati, dan buah-buahan seperti lemon, ceri, dan arbei, atau susu. Es teh adalah minuman yang sering diminum saat siang hari karena suhu udara yang panas.', 1, 'K053', 'minum', '2022-10-25 05:46:22', '2023-01-11 05:21:27'),
(56, 11, 'Teh Daun Mint', 'Myyhz8K0gM1cg4ztqu1DClqYxVFwnfoUuaeG7kk9.jpg', 5000, 'Teh merupakan salah satu teh herbal alami yang bebas kandungan kafein. Selain itu, minum teh peppermint sebelum tidur dapat membantu membuat tubuh lebih rileks dan tenang.', 1, 'K054', 'minum', '2022-10-25 05:48:36', '2022-10-25 05:48:36'),
(57, 11, 'Jeruk Hangat', '974MwDDnQ7NQbj29ttJL2OvbqVinswE9fy5d8tsE.jpg', 4000, 'Jeruk yang diperas dan diseduh dengan air panas dengan tambahan gula sangat enak dinikmati di cuaca yang dingin', 1, 'K055', 'minum', '2022-10-25 05:51:35', '2022-10-25 05:51:35'),
(58, 11, 'Es Jeruk', 'hh9OLXPjj6QapUdGM5yNAs1Nm9hxGvlfgLPUu27U.png', 4000, 'Es jeruk adalah minuman yang terbuat dari buah jeruk. menyehatkan tubuh. tentunya memiliki manfaat yang sangat baik bagi kesehatan. memiliki rasa yang lezat. Sangat cocok dinikmati di cuaca yang panas.', 1, 'K056', 'minum', '2022-10-25 05:52:45', '2022-10-25 05:52:45'),
(59, 11, 'Lemon Tea', 'r2iyxJx6nreo2nfp1Jqp2Oba2vQPLTumCtzN7VCc.jpg', 5000, 'Lemon tea adalah minuman rendah kalori yang akan membantu Anda mengatur dan mengurangi jumlah kalori yang Anda konsumsi. Selain menurunkan berat badan, lemon tea mengandung phytochemical yang membantu kondisi tubuh dalam memerangi penyakit .', 1, 'K057', 'minum', '2022-10-25 05:55:20', '2022-10-25 05:58:17'),
(60, 11, 'Lemon Tea Mint', 'XI0Qev6GctQH8iiYqqX9RhG8u4XFllcdKf7xxDKW.png', 5000, 'Lemon tea mint adalah minuman rendah kalori yang akan membantu Anda mengatur dan mengurangi jumlah kalori yang Anda konsumsi. Dibuat dengan perasan lemon ditambah daun mint membuat rasanya yang makin kezat', 1, 'K058', 'minum', '2022-10-25 06:00:44', '2022-10-25 06:00:44'),
(61, 11, 'Lemon Squash', 'c8cLhqsB0CwJRaaUKKbRd9KyikmjWD9bVUfA4QjU.png', 8000, 'Lemon Squash merupakan minuman berbahan dasar lemon dan jeruk orange yang dipadukan bersama soda serta es batu yang menyegarkan tenggorokan.', 1, 'K059', 'minum', '2022-10-25 06:02:07', '2022-10-25 06:03:09'),
(62, 11, 'Coklat Susu', 'NIx9enBYDK9Hj9JFjZnX3iNj8G1sqrO8OkvsRSo8.jpg', 8000, 'Produk minuman yang dibuat dari hasil pengolahan biji coklat dengan penambahan beberapa bahan lainnya seperti gula, susu skim, full cream dan bahan penstabil. Minuman coklat susu tergolong dalam minuman yang tidak beralkohol.', 1, 'K060', 'minum', '2022-10-25 06:04:39', '2022-10-25 06:04:39'),
(63, 11, 'Es Kopi Susu', 'YLdHtan3PniFgQSmKgOn8JNa5fJD2BOImOxfCU7s.png', 10000, 'Kopi susu adalah sajian minuman kopi yang dicampur susu, umumnya dibuat dengan metode tertentu mulai dari kopi dipadukan susu secara tradisional hingga kopi dicampur susu yang dibuat oleh barista di kedai kopi.', 1, 'K061', 'minum', '2022-10-25 06:07:53', '2022-10-25 06:07:53'),
(64, 11, 'Americano', 'y8YcB8h1PVKoWBArL6s77Q1BPejkzPTEkNvObvv2.png', 10000, 'Americano adalah minuman kopi yang dibuat dengan mencampurkan satu seloki espresso dengan air panas. Air panas yang digunakan dalam minuman ini adalah sebanyak 6 hingga 8 ons.', 1, 'K062', 'minum', '2022-10-25 06:09:03', '2022-10-25 06:09:03'),
(65, 11, 'Caffe Latte', 'wYXCOE0dWmG1vVAZlvyJElNsh1Die2rpwMBPFYiY.png', 12000, 'Caff latte adalah espresso atau kopi yang dicampur dengan susu dan memiliki lapisan busa yang tipis di bagian atasnya. Perbandingan antara susu dengan kopi pada caff latte adalah 2:1.', 1, 'K063', 'minum', '2022-10-25 06:10:07', '2022-10-25 06:12:37'),
(86, 11, 'Espresso', '3xgRDqC1FZROtBYWUgwN4piPyGyRK7m25LzEInHm.png', 8000, 'Espreso adalah jenis kopi yang dihasilkan dengan mengekstraksi biji kopi yang sudah digiling dengan menyemburkan air panas di bawah tekanan tinggi.', 1, 'K064', 'minum', '2022-10-25 06:18:24', '2022-10-25 06:18:24'),
(87, 11, 'Kopi Tubruk', 'gLutmWOG8Ud3U3nosHSC8tvDyjRGRTfdGIWru1Kk.png', 5000, 'Kopi tubruk adalah minuman kopi khas Indonesia yang dibuat dengan menuangkan air panas ke dalam gelas atau teko yang sudah diisi bubuk kopi. Bisa dengan ditambahkan gula, bisa juga tanpa gula.', 1, 'K065', 'minum', '2022-10-25 06:19:07', '2022-10-25 06:19:07'),
(88, 11, 'Tahu Petis', 'IKHLjDW1sY4xAvz6Z3m7ZbgH3OBdwMzb7PknTIJf.png', 8000, 'Tahu petis adalah jajanan khas kota Semarang berupa tahu goreng yang dimakan dengan petis yang dioleskan/disisipkan di tengah-tengah tahu.', 1, 'K066', 'snack', '2022-10-25 06:20:00', '2022-10-25 06:20:00'),
(89, 11, 'Aneka Frozen Goreng', 'gch3G8qbm0Lyq3whhZWs96ukBReDFSQ1RAbZh6K1.png', 10000, 'Makanan beku adalah makanan yang dibekukan dengan tujuan untuk mengawetkan makanan hingga siap dimakan. Sejak zaman dahulu, petani, nelayan, dan pemburu telah mengawetkan hasil usaha mereka di bangunan yang tidak terhangatkan ketika musim dingin.', 1, 'K067', 'snack', '2022-10-25 06:20:47', '2022-10-25 06:20:47'),
(90, 11, 'Tempe Goreng', 'dpm1wLHiesbWVDBSzdlf1AXs4f8fX4V5YRGrWqdJ.jpg', 8000, 'Tempe goreng adalah makanan dengan frekuensi masaknya paling tinggi di Indonesia', 1, 'K068', 'snack', '2022-10-25 06:22:38', '2022-10-25 06:22:38'),
(91, 11, 'Kare French Fries', 'wzBSNqWneZko62H3gkFAQtC9buJfQnGFNU6lSxrY.png', 8000, 'Kentang goreng adalah hidangan yang dibuat dari potongan-potongan kentang yang digoreng dalam minyak goreng panas.', 1, 'K069', 'snack', '2022-10-25 06:23:40', '2022-10-25 06:23:40'),
(92, 11, 'Nasi Putih', '637RdJODMJYJTNjOAXcO4ffYfG0Jsc8iRj8f0hnl.png', 3000, 'Nasi putih adalah sumber energi yang bagus, dan sumber karbohidrat paling ekonomis di antara sumber karbohidrat lain.', 1, 'K070', 'makan', '2022-10-25 06:24:52', '2022-10-25 06:24:52'),
(93, 11, 'Bakso', 'G2uIc2Eeo6yENSTHaha3JZShOaCiPMoN8zLIgsKt.png', 10000, 'Bakso adalah jenis bola daging yang lazim ditemukan pada masakan Indonesia. Bakso umumnya dibuat dari campuran daging sapi giling dan tepung tapioka, tetapi ada juga bakso yang terbuat dari daging ayam, ikan, atau udang bahkan daging kerbau.', 1, 'K071', 'makan', '2022-10-25 06:25:48', '2022-10-25 06:25:48'),
(94, 11, 'Nasi Tiwul', 'HTrQW0BWe2ZvoLa7mPLTpXOiTPZlcWkr0bFc78ds.png', 10000, 'Tiwul adalah makanan pokok pengganti nasi beras yang dibuat dari ketela pohon atau singkong. Tiwul dibuat dari gaplek.', 1, 'K072', 'makan', '2022-10-25 06:27:17', '2022-10-25 06:27:17'),
(95, 11, 'Ayam Kriuk', 'RLcVZ9IVgNpm4SsVzigYieDddIXTMcIgZsM4p37l.png', 10000, 'Ayam goreng renyah adalah hidangan standar dalam masakan Kanton di Tiongkok selatan dan Hong Kong. Ayamnya digoreng sedemikian rupa sehingga kulitnya sangat renyah, tetapi daging putihnya relatif lembut.', 1, 'K073', 'makan', '2022-10-25 06:29:19', '2022-10-25 06:29:19'),
(96, 11, 'Mie Rebus', 'Xnsx1o50zxpt9QeB7ZKq3gJ9tZsLPAG2iWRYL6Na.png', 10000, 'Mie rebus  adalah sebuah hidangan mi kuah dari Asia Tenggara, yang dikenal di Indonesia, Malaysia, dan Singapura. Hidangan tersebut juga biasa disebut mie kuah.', 1, 'K074', 'makan', '2022-10-25 06:30:16', '2022-10-25 06:30:16'),
(97, 11, 'Mie Goreng', 'e8k6n6xYz9hEx4OThmNnxe9QEyEhXAo3qDN5jsQ9.png', 10000, 'Mie Goreng hidangan mie yang dimasak dengan digoreng tumis khas Indonesia. Mi goreng juga populer dan juga digemari di Malaysia, dan Singapura.', 1, 'K075', 'makan', '2022-10-25 06:31:06', '2022-10-25 06:31:06'),
(98, 11, 'Nasi Goreng Tiwul', 'olX85RtnxkzFp6Hxb2ZbdVPIhVM5GXIR88DB79Di.png', 10000, 'Nasi tiwul yang digoreng dengan cita rasa khas Kare', 1, 'K076', 'makan', '2022-10-25 06:33:41', '2022-10-25 06:33:41'),
(99, 11, 'Nasi Goreng', 'VbwFJrsvgdEO93juwUuJrLny9r6mDahjCqZoAbji.png', 10000, 'Nasi goreng adalah makanan berupa nasi yang digoreng dan dicampur dalam minyak goreng, margarin atau mentega. Biasanya ditambah kecap manis, bawang merah, bawang putih, asam jawa, lada dan bahan lainnya; seperti telur, daging ayam, dan kerupuk.', 1, 'K077', 'makan', '2022-10-25 06:35:51', '2022-10-25 06:35:51'),
(100, 11, 'Ayam Gepeng', 'LhrAUk4stS1slUDbAiEXLfw4EZNczM61FS4Bx8dy.png', 17000, 'Ayam yang disajikan seperti ayam geprek namun dengan baluran tepung panir ditambah dengan sambal bawang yang nikmat .', 1, 'K078', 'makan', '2022-10-25 06:41:29', '2022-10-25 06:41:29'),
(101, 33, 'Kerupuk', 'LVS9E00roR3enfGqFOkssBHCcfz3CCPx7gqX7lW4.png', 5000, 'Makanan dibuat dari adonan tepung tapioka dicampur bahan perasa udang atau ikan. Kerupuk dibuat dengan mengukus adonan sampai matang, kemudian dipotong tipis-tipis, dikeringkan di bawah sinar matahari sampai kering dan digoreng dengan minyak goreng .', 1, 'K079', 'snack', '2022-10-26 04:46:33', '2022-10-26 04:46:33'),
(102, 33, 'Nasi Sedep', 'l8ZiIqaLu3qTs8gM9x2xuLN59GiZ0HvHVVo0waDu.png', 15000, 'Sambal : cumi/teri/tongkol/jambal', 1, 'K080', 'makan', '2022-10-26 04:49:47', '2022-10-26 04:49:47'),
(103, 33, 'Nasi Karage', 'IQX0gStSlkadTqhlJGPVSkJWi8CrDgzrOgL1KCex.png', 15000, 'Nasi Karage adalah penyajian nasi dan potongan daging potongan daging pas untuk sekali gigitan. Ditambah dengan saus : blackpepper/barbeque/sweet garlic', 1, 'K081', 'makan', '2022-10-26 04:56:15', '2022-10-26 04:56:15'),
(104, 33, 'Sambal Petai', '2tuh1I9cmCjhYtyunsss5N76xk4G2NOJGZ549GjP.png', 8000, 'Sambal yang di campur dengan Pete, Sambel ini sambel yang wangi di karenakan ada perpaduan pete dengan bahan bahan yang lainnya, Rasa yang nikmat dan LEZAT bikin kamu ketagihan Teruss!!', 1, 'K082', 'makan', '2022-10-26 05:00:14', '2022-10-26 05:00:14'),
(105, 33, 'Lalapan Petai', 'XM64Jyros3ssnOuqoS5raCbKx09wj58uO1tqHf2B.png', 5000, 'Lalapan Petai adalah sayuran yang disajikan beserta masakan Indonesia dalam keadaan mentah dengan ditambah gorengan petai .', 1, 'K083', 'makan', '2022-10-26 05:07:49', '2022-10-26 05:07:49'),
(106, 33, 'Nasi Orak Arik Telur Petai', '71jwolLRzjXzOS40EoNgmCSX40KtMwQ6LVDbjf0Y.png', 17000, 'Menu nasi orak-arik telur petai ini adalah campuran dari nasi yang dimasak dengan berbagai toping seperti telur, dan petai.', 1, 'K084', 'makan', '2022-10-26 05:11:12', '2022-10-26 05:11:12'),
(107, 33, 'Nasi Sambal Teri Petai', '7C6TedQU7PjdcpXVEqv2Nha28T18RypBtpssbG0y.png', 23000, 'Nasi dan sambal yang terbuat dari Ikan Teri dan Petai yang diolah dengan cara dimasak dengan aneka cabai segar dan rempah-rempah bumbu . Nasi , tumis kangkung , tempe goreng  , sambal teri , kerupuk , petai.', 1, 'K085', 'makan', '2022-10-26 05:20:49', '2022-10-26 05:26:54'),
(108, 33, 'Nasi Sambal Cumi Petai', 'wxebeg5d8gu9rfY7AvTg43MHwG0yalcjo0p5d8R2.png', 23000, 'Nasi dan sambal yang terbuat dari Cumi dan Petai yang diolah dengan cara dimasak dengan aneka cabai segar dan rempah-rempah bumbu segar tanpa pengawet sehingga memiliki rasa yang khas nikmat sebagai pendamping makan sehari-hari.', 1, 'K086', 'makan', '2022-10-26 05:23:15', '2022-10-26 05:23:15'),
(109, 33, 'Nasi Sambal Petai', 'Erl5gWsy1N0PSHx5dxcmtHEEejBezttLXqqxpzw7.png', 17000, 'Nasi Sambal Petai Sambal adalah nasi dengan sambal petai yang terbuat dari bahan utama cabai yang dibumbui dengan rempah sebagai penyedapnya.', 1, 'K087', 'makan', '2022-10-26 05:25:33', '2022-10-26 05:25:33'),
(110, 33, 'Wedang Uwuh', '9r8Zl9rsKPjENxvbzoheClJnxC8lEOZIPBBAm4Wq.png', 15000, 'Selain dapat mengatasi asam urat, manfaat wedang uwuh juga mampu mencegah penyakit jantung. Kandungan senyawa pada kayu manis berperan penting untuk menurunkan risiko penyakit jantung', 1, 'K088', 'minum', '2022-10-26 05:33:29', '2022-10-26 05:57:10'),
(111, 33, 'Wedang Jalema', 'rdgljLwfCjWQ2nfCYUzBYKDQw7d8JDSEuiL2cRkk.png', 20000, 'Khasiat Air Rebusan Jahe, Lemon dan MaduKandungan dalam jenis rempah itu rupanya mampu megurangi peradangan, mengendurkan otot, dan mengurangi mual akibat jumlah asam lambung yang terlalu tinggi.', 1, 'K089', 'minum', '2022-10-26 05:34:14', '2022-10-26 05:49:09'),
(112, 33, 'Wedang LUKU LUKU', 'GASdYoDCKkhYVupI1yn7Op498MEAgprvWe7x7tr0.png', 20000, 'Ramuan jahe, serai dan jeruk nipis memiliki efek menenangkan dan meredakan rasa sakit. Oleh sebab itu sangat dianjurkan minum air jahe serai ketikan nyeri haid, nyeri sendi, hingga sakit kepala.', 1, 'K090', 'minum', '2022-10-26 05:35:01', '2022-10-26 05:35:01'),
(113, 33, 'Es Jeruk', 'tJAvQ8SesMkjAm9UrlxNPuBZvQLCe4lrPq1xaZr8.png', 20000, 'Es Jeruk adalah sari buah yang diperoleh dengan memeras atau menekan isi buah jeruk. Diminum di banyak tempat di dunia, sari buah jeruk biasanya menjadi bagian makan pagi atau sarapan.', 1, 'K091', 'minum', '2022-10-26 05:37:19', '2022-10-26 05:37:19'),
(114, 33, 'Jus Alpukat', 'OicgvFkRnLjscxgfulJrP0QOgWh0tSMpnAPOjwDI.png', 20000, 'Jus buah alpukat disebut mengandung lemak tak jenuh sehingga aman untuk dikonsumsi secara rutin. Tak hanya lemak baik, minuman yang satu ini juga kaya nutrisi, seperti vitamin A, B, C, E, dan K serta karbohidrat, protein, folat, hingga magnesium.', 1, 'K092', 'minum', '2022-10-26 05:39:21', '2022-10-26 05:39:21'),
(115, 33, 'Ice Cream Vanilla / Choco', 't3FUk0kugFUvxWeNRF4RByO4XS6pufIDnjL3NTmP.png', 9000, 'Es krim adalah buih setengah beku yang mengandung lemak teremulsi dan udara. Es krim merupakan salah satu jenis makanan yang populer di dunia dan sangat digemari oleh semua kalangan.', 1, 'K093', 'snack', '2022-10-26 05:42:01', '2022-10-26 05:42:01'),
(116, 33, 'Hotteok (Isi 4)', 'Ci9R2ViDs0wCR5KHZLVjt7CSMLlnnMD80rcKbmi0.png', 22000, 'Hotteok adalah panekuk berisi pasta kacang, dijual sebagai makanan jajanan Korea Selatan. Kue ini digoreng dengan minyak yang cukup banyak, enak dimakan sewaktu masih hangat sehingga populer sebagai kudapan sewaktu musim dingin', 1, 'K094', 'snack', '2022-10-26 05:45:05', '2022-10-26 05:45:05'),
(117, 33, 'Air Mineral', 'pLPyv1guEYRH21j3Lh7eAiIU1vrSnGW3bzQZYTdv.png', 7000, 'Air putih sendiri mengandung satu atom hidrogen dan dua atom hidrogen. Sedangkan air mineral adalah air yang mengandung mineral di dalamnya, baik alami atau buatan. Jadi secara umum kandungannyalah yang berbeda satu sama lain', 1, 'K095', 'minum', '2022-10-26 05:46:45', '2022-10-26 05:46:45'),
(118, 33, 'Kopi Tubruk', 'NNeXBKvPNihBWvhjGRCIOVmhlnr0BJzhMpcSUzIN.png', 8000, 'Kopi tubruk adalah minuman kopi khas Indonesia yang dibuat dengan menuangkan air panas ke dalam gelas atau teko yang sudah diisi bubuk kopi. Bisa dengan ditambahkan gula, bisa juga tanpa gula.', 1, 'K096', 'minum', '2022-10-26 05:50:56', '2022-10-26 05:50:56'),
(119, 33, 'Kopi Tubruk Susu', '9PfaqokW5lL8kviFAHFveFfMw5y3JKrHgfqpPgO7.png', 10000, 'Kopi tubruk susu adalah minuman kopi khas Indonesia yang dibuat dengan menuangkan air panas ke dalam gelas atau teko yang sudah diisi bubuk kopi dan susu.', 1, 'K097', 'minum', '2022-10-26 05:52:03', '2022-10-26 05:52:03'),
(120, 33, 'Vietnam Drip (Hot)', 'JWZafeG5Ek3TKQp80wjO4AXG4JipnaihHdIhNfkj.png', 14000, 'Kopi Vietnam atau yang dikenal sebagai C ph sa  adalah minuman kopi dingin yang berasal dari Vietnam dan dibuat dengan cara menyeduh kopi lalu dicampurkan es batu dan susu kental manis.', 1, 'K098', 'minum', '2022-10-26 06:50:12', '2022-10-26 06:50:12'),
(121, 33, 'Vietnam Drip (Ice)', '92KMtB37hQTXXulQFiEG4XVXdhYczygoRGTNLXK1.png', 18000, 'Kopi Vietnam atau yang dikenal sebagai C ph sa  adalah minuman kopi dingin yang berasal dari Vietnam dan dibuat dengan cara menyeduh kopi lalu dicampurkan es batu dan susu kental manis.', 1, 'K099', 'minum', '2022-10-26 06:50:54', '2022-10-26 06:50:54'),
(122, 33, 'Cold Brew Vanilla Sweet Cream', 'bhm8J8cL7kildmyfoCAt94zr5Mml1NgjK0wHx5sy.png', 24000, 'Coldbrew vanilla sweet cream adalah minuman kopi es lezat yang dibuat dengan kopi dingin yang diseduh dan krim vanilla manis.', 1, 'K100', 'minum', '2022-10-26 06:55:40', '2022-10-26 06:55:40'),
(123, 33, 'Cold Brew Sparkling (For 2)', '7rfQPM0AWn76icXzPvbp3De2Jm9PZRGQqKVXd8nb.png', 32000, 'Coldbrew vanilla sweet cream adalah minuman kopi es lezat yang dibuat dengan kopi dingin yang diseduh dengan sparkling water.', 1, 'K001', 'minum', '2022-10-26 07:01:01', '2022-10-26 07:01:01'),
(124, 33, 'Teh Ori (Ice/Hot)', 'w1w7aF6pVJ3sl3aZ2YNZVSJlqmSpLQcTqpUFHpGS.png', 10000, 'Teh adalah minuman yang mengandung kafeina, sebuah infusi yang dibuat dengan cara menyeduh daun, pucuk daun, atau tangkai daun yang dikeringkan dari tanaman Camellia sinensis dengan air panas.', 1, 'K001', 'minum', '2022-10-26 07:05:19', '2022-10-26 07:05:19'),
(125, 33, 'Lemon Tea (Ice/Hot)', '7uf3Y4eC1679awy9kmP6WtParuphuP538gmMlW3q.png', 15000, 'Lemon tea adalah minuman rendah kalori yang akan membantu mengatur dan mengurangi jumlah kalori yang dikonsumsi. Selain menurunkan berat badan, lemon tea membantu kondisi tubuh dalam memerangi penyakit jantung, diabetes, kanker dan osteoporosis.', 1, 'K001', 'minum', '2022-10-26 07:09:03', '2022-10-26 07:18:27'),
(126, 33, 'Milk Tea (Ice/Hot)', '15w1ZIhgJ8RBpFZtrLjc9YLRRZWaggsZIaFLvn6q.png', 15000, 'Milk Tea adalah minuman yang merupakan campuran dari teh dan susu dalam komposisi tertentu.', 1, 'K001', 'minum', '2022-10-26 07:12:48', '2022-10-26 07:18:51'),
(127, 33, 'Ice Lychee Tea', 'BFn5uHUGh14bCDz1JNtcEkH6WFjd9FFyXFqvXrm1.png', 20000, 'Es teh leci yang segar dan harum, minuman dingin ini sangat cocok sekali di hidangkan di siang hari dapat juga dinikmati dengan keadaan panas.', 1, 'K001', 'minum', '2022-10-26 07:18:01', '2022-10-26 07:18:01'),
(128, 33, 'Coklat Ori (Ice/Hot)', 'RMrrS42U6ZKEY62kaA1M9JQrUnjQ9vCIHhY8lqOT.png', 23000, 'Coklat adalah minuman yang berasal dari biji kakao atau yang dinamakan coklat ini sudah diproses sedemikian rupa sehingga rasa coklat yang sebenarnya pahit menjadi minuman coklat yang membuat siapa saja menjadi ketagihan akan rasanya', 1, 'K001', 'minum', '2022-10-26 07:23:20', '2022-10-26 07:23:20'),
(129, 33, 'Choco Mint (Ice/Hot)', '8TGUoOz4dZGukcvywPxSieySiW8RBA0YLHKUgDYo.png', 25000, 'Mint choco atau peppermint chocolate adalah varian rasa mint atau peppermint atau mentol dan cokelat yang biasa dipakai sebagaies krim, permen, cookies, dan dessert lainnya. Varian ini menggabungkan rasa segar dari mentol dengan cokelat.', 1, 'K001', 'minum', '2022-10-26 07:47:41', '2022-10-26 07:47:41'),
(130, 33, 'Choco Vanilla (Ice/Hot)', 'R61f0t1cQLpNZEIvreEWZhnC53GLXrlhm3XFa0l8.png', 25000, 'Perpaduan coklat dan sirup vanilla', 1, 'K001', 'minum', '2022-10-26 08:04:37', '2022-10-26 08:04:37'),
(131, 33, 'Lemonade', 'WqvUn61WrSAsxNMEY30jtpG6A8uHJmKMUBS83pMf.png', 25000, 'Sari Lemon , soda dengan teh bunga telang', 1, 'K001', 'minum', '2022-10-26 08:11:49', '2022-10-26 08:11:49'),
(132, 33, 'Bluemoon', 'QAboRfAQF7kGszIifaVTjcHiefDTxm1SW6w6hxCm.png', 25000, 'Sari cucumber , fruity dengan after taste rempah , refreshing mint', 1, 'K001', 'minum', '2022-10-26 08:13:26', '2022-10-26 08:13:26'),
(133, 33, 'Pine Island', 'FDJNBIODKhNB1RsBUZoZASwWHmKFQSkqZT5w6IQj.png', 25000, 'Nanas dengan air kelapa, rasa fruity dan creamy', 1, 'K001', 'minum', '2022-10-26 08:14:22', '2022-10-26 08:14:22'),
(134, 33, 'Nasi Putih', 'TlIBbOQbsIAWblYBPMfsk9128Y6fATbFJxjH9eam.png', 5000, 'Nasi putih adalah sumber energi yang bagus, dan sumber karbohidrat paling ekonomis di antara sumber karbohidrat lain.', 1, 'K001', 'makan', '2022-10-26 08:15:44', '2022-10-26 08:15:44'),
(135, 33, 'Sayur Lalapan', 'PvQU8egHuI3XayV8seSxgrWfcnAspVDIscN9wS5C.png', 2000, 'Lalapan terdiri dari berbagai jenis sayur yang dapat dimakan mentah, direbus, atau dikukus serta dihidangkan bersama sambal. Selain menambah nafsu makan, nyatanya lalapan juga baik untuk kesehatan.', 1, 'K001', 'makan', '2022-10-26 08:21:59', '2022-10-26 08:21:59'),
(136, 33, 'Oseng Sayur', 'xQ2LnW8Ugz3LDOjjhhSNDx9cU9AVVNI3t2Ourjca.png', 7000, 'Oseng Sayur adalah sayur yang dimasak dengan sedikit minyak karena bahan makanan kaya protein umumnya mengandung minyak alami', 1, 'K001', 'makan', '2022-10-26 08:27:55', '2022-10-26 08:27:55'),
(137, 33, 'Telur Ceplok / Dadar', '3GiTNrw5dJGfFC0J2sUoOPHDftsHLy8dIclUi2Ww.png', 5000, 'Telur mata sapi adalah hidangan dari telur ayam yang digoreng dengan minyak goreng panas tanpa diaduk terlebih dahulu. Di Indonesia, makanan ini dikenal dengan \"telur ceplok\".', 1, 'K001', 'makan', '2022-10-26 08:31:24', '2022-10-26 08:31:24'),
(138, 33, 'Sambal terong / matah / tempong', '3jNcrwVZ3amczo28CKFgvf9Ej3UpQDODUOUmeMk8.png', 5000, 'Sambal terong adalah terong yang digoreng dan dicampur dengan sambel terasi\r\nSambal matah adalah sambal yang berbahan dasar mentah tanpa digerus/diuleg\r\nSambal tempong adalah sambal dengan berbahan tomat , daun jeruk dan cabai serta gulmer', 1, 'K001', 'makan', '2022-10-26 08:41:34', '2022-10-26 08:41:34'),
(139, 33, 'Sambal Bajak', 'UVx5DjgNlbFw3d62WdTnyxnD37WL0B24tIuVCLS2.png', 3000, 'sambal bajak umumnya dibuat dengan menggoreng bahan-bahan terlebih dahulu. Setelah itu, baru dihaluskan dan ditumis. Penggorengan atau penumisan ini bertujuan biar kandungan air pada sambal bisa berkurang sehingga sambal menjadi lebih awet.', 1, 'K001', 'makan', '2022-10-26 08:44:21', '2022-10-26 08:44:21'),
(140, 33, 'Sambal Tempe', 'FR4bvsM9HsMdMiBZMnK9gZvf8bTlYRYCqF2OX5VH.png', 8000, 'Sambal tempe adalah sambal bawang yang dicampur dengan tempe goreng diuleg jadi satu', 1, 'K001', 'makan', '2022-10-27 05:42:58', '2022-10-27 05:42:58'),
(141, 33, 'Sambal ikan teri / tongkol / jambal / cumi', 'F62eHbIR5QOzToHJMNSNOdceftn7MKmgwvTIGvcQ.png', 10000, 'Sambal yang dicampur dengan salah satu pilihan ikan teri / ikan tongkol / ikan asin jambal / baby cumi', 1, 'K001', 'makan', '2022-10-27 05:51:09', '2022-10-27 05:51:09'),
(142, 33, 'Singkong Goreng', 'hylEgFPrB2Gsl0pWvG1nxHm01XgDOagS8xA2YZX6.png', 13000, 'Singkong goreng juga mengandung beberapa mineral seperti zat besi yang berperan penting dalam pembentukan dan produksi sel darah merah. Hal ini sangat baik untuk menjaga kestabilan sel darah merah sehingga anda terhindar dari penyakit anemia.', 1, 'K001', 'snack', '2022-10-27 05:52:45', '2022-10-27 05:52:45'),
(143, 33, 'Tempe Mendoan', 'LrjBM7SM20cvfNb3vuWa7zxdrvjY5WS2xvDvewPp.png', 13000, 'Mendoan adalah makanan sejenis gorengan yang berasal dari Eks Keresidenan Banyumas, Jawa Tengah. Kata Mendoan sendiri berasal dari bahasa Banyumasan, yaitu mendo yang berarti setengah matang atau lembek.', 1, 'K001', 'snack', '2022-10-27 05:54:40', '2022-10-27 05:54:40'),
(144, 33, 'Tempe Goreng', 'UxsAotZWjun85zoRNV7MVfmrWm4XD9dCUktPol44.png', 13000, 'Makanan yang terbuat biji kedelai dan bahan lain yang diproses melalui fermentasi dari ragi tempe. Lewat proses fermentasi ini, biji kedelai mengalami proses penguraian menjadi senyawa sederhana sehingga mudah dicerna.', 1, 'K001', 'snack', '2022-10-27 05:57:05', '2022-10-27 05:57:05'),
(145, 33, 'Tahu Goreng', 'n2lmIzltsafKRxtgwH1TPxb4FrxjBRNvXgIxCiY3.png', 13000, 'Tahu Goreng adalah masakan dari tahu yang digoreng yang banyak ditemukan Indonesia, Malaysia dan Singapura.', 1, 'K001', 'snack', '2022-10-27 06:00:41', '2022-10-27 06:00:41'),
(146, 33, 'Tahu Mini Crispy', 'ZjwMMKDjpmhTnHP5rzZdIV9HpJXbiS8aCxZ82gN6.png', 13000, 'Tahu miny crispy adalah tahu yang di potong potong dan digoreng dengan baluran tepung sehingga sangat crispy', 1, 'K001', 'snack', '2022-10-27 06:03:29', '2022-10-27 06:03:29'),
(147, 33, 'Kentang Goreng', 'keLpla8krQQZcKipchpSFLBW6bn8xDVOcPFN7zqg.png', 13000, 'Kentang goreng adalah hidangan dari potongan kentang yang digoreng dalam minyak goreng panas. Di dalam menu rumah-rumah makan, kentang goreng yang dipotong panjang-panjang dan digoreng dalam keadaan terendam di dalam minyak goreng panas.', 1, 'K001', 'snack', '2022-10-27 06:05:11', '2022-10-27 06:05:11'),
(148, 33, 'Ayam Popcorn', 'wlVbez3kNrqhED5iaXW1TKmrXLaNX8U1DK82l99Z.png', 19000, 'Ayam popcorn adalah hidangan yang terdiri dari potongan ayam berukuran kecil yang telah dilapisi tepung roti dan digoreng. Ide ini awalnya dikembangkan oleh KFC tetapi telah menyebar.', 1, 'K001', 'snack', '2022-10-27 06:06:48', '2022-10-27 06:06:48'),
(149, 33, 'Onion Ring', 'ZGS8XGujyRUx45W1o1j95W3ExBRYiOe3hEs9Uqy0.png', 19000, 'Onion ring memiliki rasa yang gurih serta manis dari bawang bombay memang layak untuk difavoritkan. Biasanya menyantap onion ring crispy ini paling pas dengan saus sambal botolan, saus tomat, mayonaise serta sambal pedas sesuai selera.', 1, 'K001', 'snack', '2022-10-27 06:08:28', '2022-10-27 06:08:28'),
(150, 33, 'Chicken Wings (6pcs)', 'JE9fXbDpSkZx8hRuPfbVk2xpnBSnYjjI8Lw56bNc.png', 24000, 'Chicken Wings merupakan makanan yang dibuat dari Sayap Ayam yang dipadukan dengan berbagai bumbu dan bahan sehingga menghasilkan rasa yang nikmat dan gurih. Sangat cocok untuk dijadikan teman makan keluarga anda.', 1, 'K001', 'snack', '2022-10-27 06:09:58', '2022-10-27 06:10:07'),
(151, 33, 'Ayam Goreng Kampung Luku Luku', 'djTDTqXDiNeKJu3sw87ImueL31VEoUAgfJPysI2F.png', 26000, 'Bumbu khas manis gurih dengan sambal dan lalapan', 1, 'K001', 'makan', '2022-10-27 06:12:46', '2022-10-27 06:12:46'),
(152, 33, 'Empal Goreng Luku Luku', '4usWySkTYmnYkf7q9LbWXc8KcOD65wsPDo27zkKH.png', 26000, 'Daging sapi goreng khas sambal lalapan , tahu , tempe dan serundeng', 1, 'K001', 'makan', '2022-10-27 06:13:47', '2022-10-27 06:13:47'),
(153, 33, 'Ayam Geprek', 'QCCvgHF6yXS9P2Cx4a4xswDg3WiXXGFRFETQYV01.png', 19000, 'Ayam goreng tepung dengan sambal dan lalapan', 1, 'K001', 'makan', '2022-10-27 06:14:51', '2022-10-27 06:14:51'),
(154, 33, 'Nasi Goreng Sate', 'sua5gX6f2mWx4o7YXUqCfA1pcbQTbbN7jlSrcGoy.png', 22000, 'Nasi goreng disajikan dengan acar , telur ceplok dan sate ayam', 1, 'K001', 'makan', '2022-10-27 06:16:01', '2022-10-27 06:16:01'),
(155, 33, 'Mie Goreng', 'KSsENqBOrzcES6UpganwGo3C4wWRjhxx8wuHCuDV.png', 22000, 'Mie goreng bumbu jawa ditambah dengan acar', 1, 'K001', 'makan', '2022-10-27 06:16:48', '2022-10-27 06:16:48'),
