(157, 33, 'Nasi Langgi (Pedas)', 'muCy5SyraOE1vvkRYdZcVY5RJ2ET32N2FlzOfpqg.png', 21000, 'Nasi ayam sisit pedas , serundeng , kering kentang , telur dadar suwir dan lalapan', 1, 'K001', 'makan', '2022-10-27 06:19:06', '2022-10-27 06:19:06'),
