(161, 33, 'Nasi Tempong', 'JZltZfP8Vvh5bm42tSRL78xNvCd0sdCb8PUYMUdC.png', 15000, 'Nasi , sambal tempong , sayur , ikan asin , tahu dan tempe goreng', 1, 'K001', 'makan', '2022-10-27 06:24:12', '2022-10-27 06:24:12'),
(162, 41, 'Sambal Pecel Kecil', '59fLtXGtPvQOEFUcqDA4TjiHRIpawCNeb8UEs4Qn.jpg', 5000, 'Bahan-bahan untuk membual pecel sendiri ternyata mudah untuk didapatkan, bahannya adalah kacang goreng sangrai yang sudah di diamkan semalaman, bawang putih goreng, cabai rawit goreng, gula jawa, asam jawa, serta bumbu penyedap tambahan.', 1, 'K001', 'makan', '2022-10-28 00:41:04', '2022-10-28 00:41:04'),
(163, 41, 'Sambal Pecel 1/2 kg', 'IQ9L1wQ1HjCDeuKPxNkGzlO5UvlVE3wzFgW6V1cf.jpg', 23000, 'Bahan-bahan untuk membual pecel sendiri ternyata mudah untuk didapatkan, bahannya adalah kacang goreng sangrai yang sudah di diamkan semalaman, bawang putih goreng, cabai rawit goreng, gula jawa, asam jawa, serta bumbu penyedap tambahan.', 1, 'K001', 'makan', '2022-10-28 00:41:43', '2022-10-28 00:41:52'),
