INSERT INTO `tb_tempat` (`id`, `user_id`, `kategori`, `name`, `deskripsi`, `alamat`, `email`, `telp`, `sosmed`, `galeri`, `status`, `htm`, `created_at`, `updated_at`, `image`, `image2`, `jambuka`, `jamtutup`, `gmaps`, `dana`, `induk_id`, `open`, `video`, `slug`, `sejarah`, `akses`, `atraksi`, `unggulan`, `lokasi`) VALUES
(1, 'D006', 'desa', 'Desa Watu Gambir', 'Watu Gambir Park ini berlokasi di Dusun Telap yang berjarak sekitar 2 kilometer (km) ke arah timur laut dari Balai Desa Karang. Memiliki pemandangan yang indah, Watu Gambir Park akan dilengkapi dengan berbagai fasilitas wisata seperti camping ground atau lahan perkemahan, river tubing atau susur sungai, kolam renang, dan lainnya.', 'Karanganyar, Jawa Tengah', 'watugambir@gmail.com', '081216213301', NULL, NULL, 0, 0, '2022-08-21 02:29:52', '2022-12-21 03:53:14', 'Yflq0N9uHXsDP9rpLWK0o0vr1ysCsVEqmT6qtc3g.jpg', 'WDhHchMxM5A2VOwxWjdDeoHm7FIl3mES0N2dnClm.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'vB4zaXIOLSo6JJt3kZweFTLzzQexcXkp2oZc7LBt.jpg', 'desa-watu-gambir', 'Sejarah desa gambir akowkwaokwokaokwaa', '5 kilometer dari kota', 'Arung jeram, camping, ATV', NULL, NULL),
(2, 'D007', 'wisata', 'Event Desa Watu Gambir', 'Desa Watu Gambir adalah desa yang terletak di Karanganyar, Jawa Tengah.', 'Karanganyar, Jawa Tengah', 'eventwatugambir@gmail.com', '0271647658', NULL, NULL, 0, 0, '2022-08-21 02:51:54', '2022-10-30 08:03:47', 'ifBHbfsuCEpKhcCd5Z3NvuchI6icINggxzNasjy9.jpg', 'Sy9qrxk3zY7PQYHqI5simTHJfjAjfvsuhx2aWFf8.jpg', NULL, NULL, NULL, NULL, '1', 0, 'TxAwkY4m8uVoiev32yyvBipmm1VJOYiOIrcjr2Rh.m4v', 'event-desa-watu-gambir', NULL, NULL, NULL, NULL, NULL),
(3, 'D002', 'wisata', 'Wisata Watu Gambir', 'Tempat wisata di daerah tawangmangu yang keren :)', 'Karanganyar, Jawa Tengah', 'wisatawatugambir@gmail.com', '0271647658', NULL, NULL, 0, 10000, '2022-08-21 02:56:45', '2022-11-04 09:56:46', 'smuS6ZmLeq9GGlc4Gr3pAs0Dhryz7gKQt7JKkclo.jpg', '7mWOwfogo2Cti75FtFkpDcsOQ9khLOzWtWdAttBP.jpg', NULL, NULL, NULL, 0, '1', 0, 'Q8MgB3Ji7od8QOG68rFog6RMGUdZfKI0Hndh6tBd.m4v', 'wisata-watu-gambir', NULL, NULL, NULL, NULL, NULL),
