(9, 'D014', 'desa', 'Desa Wisata Kare', 'Desa Kare Kecamatan Kare Kabupaten Madiun Terletak paling tenggara Kabupaten Madiun. Merupakan Daerah berbatasan dengan Kabupaten Lain yaitu Ponorogo,Trenggalek, Tulungagung, Nganjuk dan Kediri. Merupakan Daerah Pegunungan Wilis yang terdiri dari berbagai bukit dan gunung. Banyak Potensi Wisata yang bersifat alam dan buatan. Untuk itu perlu kebersamaan dalam pengelolaan alam yang ada di Kare melalui berbagai bidang dan inovasi yang terus menerus untuk melestarikan wisata alam tersebut guna kesejahteraan masyarakat Desa Kare.', 'Kare, Madiun', 'kare@gmail.com', '081331326510', NULL, NULL, 1, 0, '2022-09-21 23:09:26', '2022-12-01 04:29:24', 'J8w8Otbh6GhHeF3C7JUeaIFBzZvB0365DeAwMfyB.jpg', 'RHsoLcH63Tmh4ZcWSdapwwDAIzn6gbUKDnmMVMqF.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'desa-wisata-kare', 'Legenda Desa ini diambil dari penuturan para orang tua / dongeng dari satu orang ke orang lain yang sudah turun temurun di Desa Kare; dongeng atau kisahnya sebagai berikut : Di lereng Gunung Wilis hidup seorang tokoh bernama Ki Ageng Wilis sesuai dengan tempat pertapaannya. Ki Ageng Wilis mempunyai keponakan yang bernama Ki Joko Slining. Pada suatu hari, Ki Joko Slining akan mempersunting seorang putri bernama Putri Kencono Wungu yang merupakan keponakan dari Adipati Madiun yang disayembarakan untuk mencari jodoh. Mendengar berita itu, maka pada siang hari berangkat Ki Joko Slining dengan sahabatnya menuju Padepokan Putri Kencono Wungu dengan menaiki sebuah perahu sampan dari batu mulai dari puncak Gunung Wilis. \r\n\r\n           Di tengah perjalanan perahu tersebut terjebak oleh pusaran air. Untuk mengenang tempat tersebut maka diberi nama Seran. Setelah berhasil melewati pusaran air, perjalanan dilanjutkan. Tapi karena teman Joko Slinning kelelahan, maka ia tertidur lama (suwe turu wae = bhs. Jawa ). Di suatu tempat di atas batu yang bernama Selo Bekel maka untuk mengingat tempat tersebut diberi nama Suweru. Setelah temannya bangun dari tidur, perjalanan dilanjutkan. Namun karena kecapekan dan baru bangun dari tidur maka kapal yang ditumpangi terpleset tapi masih selamat. Maka tempat terpleset itu diberi nama Plosorejo. Kemudian setelah berjalan beberapa saat, hari sudah menjelang sore dan tiba di suatu tempat melihat ada bunga Dipoyono yang sangat indah,maka bunga itu dipetik untuk tanda melamar Putri Kencono Wungu. Untuk mengenang tempat pemetikan bunga tersebut, maka daerah itu diberi nama Kare ( berasal dari kata Sekar Mekar Sore ). Setelah dilanjutkan perjalanan, tali kapal yang ditali wangsul berkali-kali putus. \r\n\r\n           Oleh karena itu, tempat itu diberi nma Gondosuli ( Gonta ganti tali Wangsul ). Tali yang terputus tadi disambung-sambung di suatu tempat yang kemudian dinamai Sambong. Dalam perjalanannya ternyata perahu yang ditumpangi tersangkut di suatu tempat sampai pagi tiba, sehingga Ki Joko Slining tak bisa mengikuti sayembara. Ia merasa gagal dan malu karena tak bisa mengikuti sayembara mempersunting Putri Kencono Wungu. Maka tempat itu dinamai Kuwiran ( kewirangan = Bhs. Jawa ) sehingga kapalnya ditinggal begitu saja di sana. Kapal tersebut sampai sekarang masih ada di tengah hutan di Desa Kuwiran. Ini lah legenda Desa Kare agar anak cucu warga Desa Kare mengetahui asal usul nama desanya.\r\n\r\n                Asal Usul Penduduk Desa KareAsal usul penduduk Desa Kare menurut penuturan / dongeng orang tua secara turun temurun yaitu :Pada zaman dahulu datang serombongan petani dari daerah Caruban. Mereka hidup sebagai petani yang meninggalkan daerah asalnya karena ingin aman dari kekejaman bangsa Belanda. Rombongan ini dipimpin seorang bernama KARTODIPURO. Dengan hidup bertani secara tekun dan membawa pengalaman dari daerah asal maka hasil tani sangat memuaskan.Banyak petani yamg berbondong-bondong menuju daerah pak Kartodipuro. Namun sayangnya daerah yang ditempati pak Kartodipuro masih menjadi satu dengan Desa SALAK, yang sekarang menjadi dukuh Salak termasuk Desa Randualas. Berhubung makin banyak pengikut menuju daerah pak Kartodipuro maka diadakan pemekaran Desa Salak. Dengan demikian daerah yang ditempati pak Karto merupakan daerah baru  Mekare Desa Salak . Kata Mekare kemudian dikenal dengan Desa KAREE. Daerah Kare merupakan daerah yang merupakan pelarian dari orang-orang yang tidak mau tunduk kepada Belanda. Selanjutnya, Desa Kare makin ramai dan didirikan pemerintahan tingkat Kawedanan yang bertempat di Dusun Kare. Pemangku Wedono pada saat itu bernama KARTO HADIKUSUMO. Namun akhirnya pusat Kawedanan dipindahkan ke Kanigoro.', 'Dari Kota Madiun Menuju desa kare', 'Banyak Sekali potensi wisata seperti wisata alam, budaya dan buatan', NULL, 'https://goo.gl/maps/TrPtgBXBgtZ4BorM8'),
(10, 'D054', 'wisata', 'Nongko Ijo', 'Hutan dengan pohon pinus yang masih rindang ditambah ada beberapa gazebo. Tiket masuknya sebesar Rp. 5.000 kalian sudah bisa menikmati segarnya udara. Disana juga terdapat warung yang bisa kalian nikmati jajanannya, dibawah pohon pinus ini terdapat sungai yang alirannya digunakan untuk PLTA. Terdapat dua PLTA yang berada di Desa Kare yaitu, PLTA Giringan di Desa Kepel dan PLTA Gulang di Desa Wiran.', 'Kare, Madiun', 'wisatakare@gmail.com', '089343448005', NULL, NULL, 1, 20000, '2022-09-23 05:00:57', '2023-01-12 18:56:40', 'hglHQHRInKusFSVKC7VUEfyxEq3sBcucTPAF7t20.jpg', 'Ga3emRLbE5Zwl1GXDv1FZWir2yQCxqufAeEoisWo.jpg', NULL, NULL, NULL, 2855000, '9', 0, 'Cs9Jzd1W2tTACtDwpgpbBkevZTiSiEE0PURE8ecY.mp4', 'nongko-ijo', 'Pohon Pinus ditanam mulai tahun 1981. Menurut pengelola hutan pinus, sejarah awal mula dinamakan \"Nongko Ijo\" berawal dari cerita dahulu pada awal ditanam pohon pinus terdapat pohon nongko hijau yang sangat besar yang tumbuh disekitar hutan. Hutan Pinus Nongko Ijo dikenal di masyarakat luas semenjak ada salah satu media masa (surat kabar) yang meliput keberadaan hutan pinus dengan isi berita menyebutkan nama hutan pinus nongko ijo. Hingga sekarang masyarakat mengenal hutan pinus tersebut dengan nama nongko ijo.', 'Dari Pemerintah Kota Madiun ambil arah selatan menuju Jl. Pahlawan sejauh 50 m, lalu belok kiri ke Jl. Pahlawan sejauh 10 m, lalu belok kiri ke Jl. Perintis Kemerdekaan sejauh 400 m, lalu belok kanan ke Jl. Dr. Sutomo sejauh 300 m, kemudian belok kanan ke JL. Diponegoro sejauh 1,3 km, lalu belok kanan ke Jl. Slamet Riyadi melewati Indorhema teknik sejauh 1,9 km, setelah melewati Sinar Delima belok kanan ke Jl. Tanjung Raya sejauh 1,1 km, kemudian belok kiri ke Jl. Dungus Manis / Jl. Raya Dungus sejauhh 19 km, setelah itu belok kanan ke Jl. Raya Dungus / Jl. Raya Kandangan sejauh 2 km, terus lurus sejauh 220 m, lalu belok kiri sejauh 300 m, dan anda akan tiba di Hutan Pinus NONGKO IJO.', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3953.5143966788296!2d111.6825873!3d-7.7351317!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afe6906b5b9b%3A0x596fc20d052be1ff!2sHutan%20Pinus%20NONGKO%20IJO!5e0!3m2!1sid!2sid!4v1669870003018!5m2!1sid!2sid'),
(11, 'D032', 'kuliner', 'Sekar Wilis', 'Restaurant Sekar Wilis', 'Kare, Madiun', 'adminsekarwilis@gmail.com', '81204812', NULL, NULL, 1, 0, '2022-09-23 05:14:48', '2022-12-16 09:14:44', '7hXeLxbkT4Qs4Jk1yA7NcWjv8PCWrKKCIhJdaVw1.jpg', 'AqJmIU3jwMTLlzQNrLBdQvGrErQNKkGORkj9eA6H.jpg', NULL, NULL, NULL, 104000, '9', 1, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'sekar-wilis', NULL, 'Dari Pemerintah Kota Madiun ambil arah selatan menuju Jl. Pahlawan sejauh 50 m, kemudian belok kiri ke Jl. Pahlawan sejauh 10 m, kemudian belok kiri ke Jl. Perintis Kemerdekaan sejauh 400 m, kemudia belok kiri ke Jl. Dr. Sutomo sejauh 300 m, kemudian belok kanan ke Jl. Diponegoro sejauh 1,3 km, kemudian belok kanan ke JL. Slamet Riyadi melewati Indorhema Teknik sejauh 1,9 km, setelah melewati Sinar Delima belok kanan ke Jl. Tanjung Raya sejauh 1,1 km, kemudian belok kiri ke Jl. Dungus Manis / Jl. Raya Dungus sejauh 19 km, kemudian belok kanan ke Jl, Raya Dungus / Jl. Raya Kandangan sejauh 1 km, lalu belok kiri sejauh 2, km dan anda akan tiba di Sekar Wilis Resto Kare.', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.390408563395!2d111.699846!3d-7.7483493999999995!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79aff2833d7301%3A0xd66901fc900f0c3b!2sSekar%20Wilis%20Resto%20Kare!5e0!3m2!1sid!2sid!4v1669871569097!5m2!1sid!2sid'),
