(16, 'D015', 'wisata', 'Air Terjun Selampir', 'Air terjun yang terletak di lereng gunung Wilis, tepatnya di Desa Kare. Destinasi ini masih satu wilayah dengan perkebunan  kopi Kandangan di wilayah Kabupaten Madiun . Dengan ketinggian 400 m dpl serta luas sekitar 6 Ha, menjadikan tempat ini begitu sejuk dan nyaman untuk dinikmati . Dimanjakan dengan sumber mata air dari bawah gunung dan muncul di atas pepohonan yang rindang.', 'Desa Pakuan, Kecamatan Kare. Kabupaten Madiun, Provinsi Jawa Timur, Indonesia', 'admin@gmail.com', NULL, NULL, NULL, 1, 20000, '2022-10-11 16:21:04', '2022-11-28 07:21:07', 'i21j3MYeoIAEjtnEjcGrWTx52nxuyH5ohL6xIpQw.jpg', 'A1JogWhQ4P8g2rdekSousNuwADtRODL6zD8mmOwf.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'air-terjun-sewerslampir', NULL, 'Jarak menuju ke wisata Air terjun ini adalah sejauh 25 km dari pusat kota madiun. Ambil jalan menuju arah ke timur di Kecamatan Kare sampai ke perkebunan kopi. Kemudian lanjut Pertigaan atau persimpangan jalan tersebut ada di kiri jalan. Disitu pengunjung akan menemukan petunjuk menuju lokasi wisata.', 'Tempat ini merupakan salah satu wisata alam yang sangat eksotis. Air terjun ini terletak di deretan lereng pegunungan dengan suasana alamnya yang adem dan penuh nuansa yang masih alami , khas pedesaan.', 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d494.1748861900206!2d111.70283812936094!3d-7.747424699999992!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79af166d0a66a7%3A0xa6f11a4a28e6bedb!2sAir%20Terjun%20Selampir%2FKedung%20Malem!5e0!3m2!1sen!2sid!4v1669875685572!5m2!1sen!2sid'),
(17, 'D015', 'wisata', 'Agro Wisata Perkebunan Kopi Kandangan', 'Bagi pecinta kopi, tempat ini tidak bisa kita abaikan. Robusta Wiis, begitulah para pecinta kopi menyebutnya. Kopi ini di tanam di area perkebunan yang luasnya kurang lebih 2.500 Ha.\r\n\r\nDestinasi ini memiliki sejarah panjang sejak masa kolonial Belanda. Konon, masa itu kopi Kandangan termasuk jajaran pabrik besar di Asia Tenggara dan pasarnya sampai ke Eropa.\r\n\r\nKIni, area ini sudah berkembang menjadi destinasi wisata unggulan di Kabupaten Madiun. Kita bisa mengenang masa kejayaan perkebunan kopi Kandangan, sambil menikmati hamparan hijau sejauh mata memandang. Jika kita pagi sekali datang kesini , akan disuguhi kabut tipis putih yang menyelimuti pucuk-pucuk pohon kopi.', 'Kandangan, kecamatan Kare, kabupaten Madiun.', 'admin@gmail.com', NULL, NULL, NULL, 1, 5000, '2022-10-11 16:38:40', '2022-11-29 05:27:07', 'qp72bfGI2h88T2hJpfrXxpKVCoBMKKqo09YL57bS.jpg', 'JjjrLTrRfd548M0zzMBmS5MxQdtEK45V5zu0zpgf.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'agro-wisata-perkebunan-kopi-kandangan', NULL, 'Dari Pemerintah Kota Madiun ambil arah selatan menuju Jl. Pahlawan sejauh 50 m, lalu belok kiri ke Jl. Pahlawan sejauh 10 m, lalu belok kiri ke Jl. Perintis Kemerdekaan sejauh 400 m, lalu belok kanan ke Jl. Dr. Sutomo sejauh 300 m, kemudian belok kanan ke JL. Diponegoro sejauh 1,3 km, lalu belok kanan ke Jl. Slamet Riyadi melewati Indorhema teknik sejauh 1,9 km, setelah melewati Sinar Delima belok kanan ke Jl. Tanjung Raya sejauh 1,1 km, kemudian belok kiri ke Jl. Dungus Manis / Jl. Raya Dungus sejauhh 19 km, setelah itu belok kanan ke Jl. Raya Dungus / Jl. Raya Kandangan sejauh 1 km, kemudian belok kiri sejauh 2 km, kemudian belok kanan untuk tetap di Jl. Raya Kandangan sejauh 120 m, lalu belok kanan sejauh 1,9 km, kemudian belok kiri sejauh 80 m, lalu belok kiri lagi sejauh 70 m dan anda akan tiba di PT Perkebunan Kandangan.', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3953.290850923268!2d111.6985765!3d-7.7589465!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afa543fa2563%3A0x8c8e87386961ccdc!2sPT%20Perkebunan%20Kandangan!5e0!3m2!1sid!2sid!4v1669871795833!5m2!1sid!2sid'),
(18, 'D015', 'wisata', 'Tambak Lare', 'Wisata yang terletak di ketinggian kurang lebih 850 MDPL ini memiliki pesona alam yang masih begitu alami dan menawarkan keindahan yang berbeda dengan tempat wisata yang lainnya. Selain bisa menikmati keindahan alam pengunjung juga bisa belajar mengenai tanaman, sebab tambak lare juga dikonsep menjadi salah satu wahana wisata edukasi yang masih alami dengan tanaman lokal, seperti kopi, kakao, durian, cengkeh, dan ditambah lagi dengan keindahan taman bunga yang ditata sedemikian cantiknya.', 'Desa Wisata Kare, Kabupaten Madiun, Jawa Timur', 'admin@gmail.com', NULL, NULL, NULL, 0, 5000, '2022-10-11 16:48:04', '2022-10-30 09:04:44', 'hb9cAFLEeqBRJlCMWjDeldiSbTWeSJcnzSGuwI1n.jpg', '4ujOvfWouHZZ80cuyPN0gpN5Qv1DWoQfB9FhEi8s.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'tambak-lare', NULL, NULL, NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.414765580487!2d111.6976658!3d-7.745754599999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afc71946d915%3A0x4254a59851f2b2bf!2sWisata%20tambak%20lare!5e0!3m2!1sid!2sid!4v1669871925346!5m2!1sid!2sid'),
(19, 'D052', 'wisata', 'Padepokan Ki Ageng Pandan Alas', 'Padepokan yang terletak di Desa Kare', 'Gondosuli, Kare, Madiun Regency, East Java 63182', 'wisatakare@gmail.com', '081234456788', NULL, NULL, 0, 0, '2022-10-19 05:32:55', '2022-10-30 09:51:02', '1zEDgBxZi9CeMoLbGw6Fb1bKjMsYHFZPutc4j3uV.jpg', '109bC3gYa9hH6Wi4AtPH0ya4XODGNr7JdcmGGP31.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'padepokan-ki-ageng-pandan-alas', NULL, NULL, NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.65714244145!2d111.68803241477765!3d-7.71988649443544!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79b0228474451d%3A0xb55e08fe954b2345!2sPadepokan%20Ki%20Ageng%20Pandan%20Alas!5e0!3m2!1sen!2sid!4v1669874231467!5m2!1sen!2sid'),
(33, 'D020', 'kuliner', 'Luku Luku Cafe', 'Luku Luku Cafe adalah sebuah tempat makan yang ada di Kabupaten Madiun . Tepatnya di Jalan Raya Randualas , RT.02/RW.01, Gondosuli, Kare, Madiun . Luku Luku di ambil dari kata \"luku\" yg merupakan alat bajak tradisional. Alat bajak dalam pertanian bisa juga di filosofikan sebagai bagian dari mempersiapkan tanah supaya baik ditanam dan juga menabur benih. Dengan banyaknya \"luku luku\" kami harap Luku Luku Cafe bisa menjadi tempat kami siap untuk \"ditanami\" benih- benih yang baik dan dapat menghasilkan \"buah- buah\" yang berguna bagi banyak orang.', 'Jalan Raya Randualas , RT.02/RW.01, Gondosuli, Kare, Madiun .', 'adminlukuluku@gmail.com', '0812345567880', NULL, NULL, 1, 0, '2022-10-25 06:54:41', '2023-02-22 08:26:58', 'OpD5RAXTR4tKogZ2ZmIwrd9yJRhZDAyyxXJFufq9.png', '7W5ZzoCoDJ4ZBLOuBvW4rCGU4e4WgNL8QVDoijZm.jpg', NULL, NULL, NULL, 428000, '9', 1, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'luku-luku-cafe', NULL, NULL, NULL, 1, 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d506073.62210825237!2d111.1268033!3d-7.715285!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79b107f8fbd7bf%3A0xd0de916d1d23b605!2sLuku%20luku!5e0!3m2!1sid!2sid!4v1669872075421!5m2!1sid!2sid'),
(37, 'D075', 'wisata', 'Aswin Loka', 'sarana wisata yang edukatif yang berada di Dusun Seweru Desa Kare Kare.Aswin Loka merupakan wahana belajar secara factual terhadap ekosistem lingkungan hidup yang memberikan warna dan nilai kemanusiaan.', 'Branjang, Kare, Kec. Kare, Kabupaten Madiun, Jawa Timur 63182', 'aswinloka@gmail.com', '08123456787', NULL, NULL, 1, 0, '2022-10-27 07:20:41', '2022-12-14 08:10:20', 'lapT8YYfD8eEgL8Epdh4JjbVQ9InbZ3OOfX1QmWK.jpg', 'ALSSvOUhAbZULNqZubIsbabFLfVxMiuIcCSNH3ah.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'aswin-loka', NULL, NULL, 'Terdapat tempat pertemuan di pusat bangunannya,  sanggar, gamelan dan terdapat phon-pohon istimewa seperti pohon kepel, pohon cendana, dan pohon nagasari.', 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.406408489037!2d111.69836851477784!3d-7.746644994416585!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afdd0eebcd2b%3A0x2d6e7585df3c0e32!2sAswin%20Loka%20Seweru!5e0!3m2!1sen!2sid!4v1670999787070!5m2!1sen!2sid'),
(39, 'D036', 'penginapan', 'Villa Kandangan', 'Villa yang berada Dusun Kandangan ini milik PT. Perusahaan Perkebunan Kandangan. Villa ini masih berdiri kokoh terawat dengan 84 kamar dan 2 tempat makan. Villa ini terbagi menjadi 8 bangunan. Villa ini di bangun pada tahun 2003 dan sering digunakan untuk event-event besar. Sebelum menjadi sebuah bangunan villa, tempat ini dulunya adalah sebuah perkebunan kopi milik pribadi dengan luas lahan 2.534 hektar ketika panen bisa mencapai hasil 200 ton kopi kare. Karena tempatnya yang jauh dari pusat kota, villa ini jarang dikunjungi.', 'Desa Kare, Madiun, Jawa Timur', 'villakandangan@gmail.com', '098765432123', NULL, NULL, 1, 0, '2022-10-27 07:44:14', '2022-12-20 03:44:11', 'LPBLqlbhbKiJgnyeeS3rL2QzgqfZK4tIhRnR2Ogu.jpg', '8kqC43Lx5Hv1rqL2CVMoa50TBKWICmM6HuP2AaDo.jpg', NULL, NULL, NULL, 200000, '9', 1, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'villa-kandangan', 'Villa ini di bangun pada tahun 2003 dan sering digunakan untuk event-event besar. Sebelum menjadi sebuah bangunan villa, tempat ini dulunya adalah sebuah perkebunan kopi milik pribadi dengan luas lahan 2.534 hektar ketika panen bisa mencapai hasil 200 ton kopi kare', 'Dari Madiun menuju Desa Kare', 'Villa untuk menampung banyak tamu', 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.243324795493!2d111.7052836!3d-7.7640002!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afa922385ab9%3A0xf7fe60a780c4139e!2sVilla%20Perkebunan%20Kandangan!5e0!3m2!1sid!2sid!4v1669872001596!5m2!1sid!2sid'),
(40, 'D037', 'wisata', 'Makam Brimob', 'Dahulu saat Agresi Militer Belanda II terjadi adu tembak yang menewaskan Sanali seorang Komandan Muda Polisi, Sakip seorang Agen Polisi I dan 4 orang masyarakat. Sekarang jenazahnya sudah di pindahkan ke Taman Makam Pahlawan Madiun. Bisa dilihat ternyata Desa Kare juga memiliki sejarah dengan Belanda. Beberapa bulan sekali Brimob Madiun melakukan napak tilas.', 'Kare , Madiun', 'makambrimob@gmail.com', '089123456', NULL, NULL, 1, 0, '2022-10-27 07:45:39', '2022-11-29 05:26:40', 'VmH919TetcYw1cfEc1AVW0xhmBbTmeJBuuFXENMu.jpg', 'HymDIBIEhOHL68HWahsjaR4LQNwg8sdbFjILKhUE.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'makam-brimob', NULL, NULL, NULL, 1, 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3953.291866243821!2d111.6993724!3d-7.7588385!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x2f803721d4d93254!2sTugu%20peringatan%20MOBRIG!5e0!3m2!1sid!2sid!4v1669871745821!5m2!1sid!2sid'),
(41, 'D038', 'kuliner', 'Sambal Pecel Madiun', 'Pemilik dari usaha ini adalah Ibu Utami Sambong atau yang akrab disebut Ibu Utami, beliau mulai merintis usaha sambal pecel sejak tahun 2012. Awalnya penjualan hanya dijual ke pasar, lama kelamaan ada beberapa reseller di luar wilayah Madiun. Dalam produksinya 2-3 hari bisa menjual 1 kuintal sambal kacang yang penjualannya masih dalam Daerah Madiun. Kemasan sambal pecel dikategorikan menjadi 3 yang pertama kemasan ekonomis dengan harga Rp. 5.000, kemasan tanggung kg Rp. 23.000, dan kemasan besar 1kg Rp. 45.000. Bahan-bahan untuk membual pecel sendiri ternyata mudah untuk didapatkan, bahannya adalah kacang goreng sangrai yang sudah di diamkan semalaman, bawang putih goreng, cabai rawit goreng, gula jawa, asam jawa, serta bumbu penyedap tambahan.', 'Madiun', 'sambelpecel@gmail.com', '08987654321', NULL, NULL, 1, 0, '2022-10-27 13:54:30', '2022-11-29 06:21:46', 'YarANkRx43kM2WqJAOHYqw01ReP5hmjmcKsuo2LY.jpg', 'uHWPDmzSBPHMaB9yBm2jrckCXpDfBNQQbNqVab5c.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'sambal-pecel-madiun', NULL, NULL, NULL, NULL, NULL),
(42, 'D039', 'seni & budaya', 'Kesenian Caplokan', 'Salah satu kesenian yang berada di Madiun adalah caplokan, Di Desa Kare Madiun menjadi tempat yang masih melestarikan kebudayaan caplokan, salah satunya Sanggar Caplokan Ronggo Wilis Saputro yang dikelola langsung oleh Pak Bini. Sanggar ini sudah ada dari tahun 970 karena peralatan sudah tidak memadai akhirnya berhenti. Pada Tahun 2012 Pak Bini mendapatkan anggaran dari pemerintah setempat, akhirnya kembali aktif lagi. Anggota sanggar ini adalah pemuda yang ada di Desa Kare dan sekitarnya, salah satu contoh untuk melestarikan kebudayaan dengan mengajarkan kesenian kepada generasi muda. Caplokan biasanya ditampilkan saat acara-acara besar dan pagelaran budaya. Caplokan yang di kelola oleh Pak Bini pernah tampil dalam kejuaraan seni tingkat provinsi dan mendapatkan juara 2.', 'Kare, Madiun', 'caplokan@gmail.com', '08972244242525', NULL, NULL, 1, 0, '2022-10-27 16:18:08', '2022-11-28 08:16:29', '3v5svdKmRBd3vWGDzuMLOA0cljX0pJQnGno1XVhf.jpg', 'Sr5yKa4VX3zbYK0lml7IDNre1Xn3MSDZi9NUgNoQ.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kesenian-caplokan', NULL, NULL, NULL, 1, NULL),
(43, 'D040', 'seni & budaya', 'Kesenian Ganong dan Jathilan', 'Salah satu kesenian khas Daerah Ponorogo juga dikembangkan di Desa Kare. Sanggar Seni Singo Mudho Manunggal salah satu sanggar yang menjadi tempat dikembangkannya Seni Ganong, Jathilan, dan Reog Ponorogo yang dikelola oleh Pak Dicky. Sebelum sanggar ini berdiri Pak Dicky melatih di TK Kare dan mengikuti paguyuban seni reog, karena lama kelamaan paguyuban itu sepi karena orang-orang mulai menghilang akhirnya beliau bertekat untuk membangun sanggar sendiri. Anggota sanggar ini adalah anak-anak usia 5 tahun sampai 11 tahun baik di Desa Kare maupun luar Desa Kare. Namun sanggar ini masih belum memiliki dadak merak sehingga saat ada job event beliau menyewa dari luar Daerah Madiun.', 'Kare, Madiun', 'ganongjathilan@gmail.com', '089372812738', NULL, NULL, 1, 0, '2022-10-27 17:21:10', '2022-11-28 07:30:17', 'luXw8OXdRz0uVJV55M2zbsAWUYlyWCHN0vK4vH1L.jpg', 'CbnEatMkg05wLWeLliYDDLCrB8xyS0Y3LFzP3D2h.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kesenian-ganong-dan-jathilan', 'Jathilan ini pada awalnya ditarikan oleh laki  laki yang halus, berparas ganteng atau \r\nmirip dengan wanita yang cantik. Gerak tarinya pun lebih cenderung feminin. Sejak tahun \r\n1980 an ketika tim kesenian Reog Ponorogo hendak dikirim ke Jakarta untuk pembukaan \r\nPRJ (Pekan Raya Jakarta), penari jathilan diganti oleh para penari putri dengan alasan lebih \r\nfeminin. Ciri  ciri kesan gerak tari jathilan pada kesenian Reog Ponorogo lebih cenderung \r\npada halus, lincah dan genit. Hal ini didukung oleh pola ritmis gerak tari yang silih berganti \r\nantara irama mlaku (lugu) dan irama ngracik.', NULL, NULL, 1, NULL),
(44, 'D041', 'seni & budaya', 'Kesenian Dongkrek', 'Dongkrek Enggal Budoyo Desa Kare yang diketuai oleh Bapak Bardi, dongkrek sendiri merupakan kesenian dan kebudayaan asli dari Kabupaten Madiun. Dongkrek bisa ditemukan di Daerah Gonalan dan Wijayan. Bapak Bardi sendiri mulai merintis di Desa Kare pada tahun 2017 hingga sekarang, dengan anggota para sepuh yang ada di Desa Kare namun sekarang sudah dikembangankan menjadi extrakulikuer di sekolah dasar yang ada di Desa Kare. Anggota dongkrek sendiri ada 14 orang (termasuk penari) ditambah sinden, para penari mengenakan topeng yang terbuat dari kayu dengan berbagai macam bentuk karakter.', 'Kare, Madiun', 'dongkrek@gmail.com', '089453782811', NULL, NULL, 1, 0, '2022-10-27 17:24:10', '2022-11-28 07:28:09', 'uvDptGxosPjIlcQEgqgItsPN58AEM9wyJhYNFOPW.jpg', 'V2T0d5EnOAKa7oUBhaJNxCrmrPwgFcodIywNGQTX.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kesenian-dongkrek', 'Asal usul nama dongkrek adalah pada zaman dahulu gamelan hanya terdiri dari dong yang dipukul akan berbunyi dong dan alat musik bernama krek yang mengeluarkan suara krek, jadilah nama dongkrek. Kesenian ini dirintis oleh nenek moyang pada tahun 1950-an dan mulai berdiri secara resmi pada tahun 1968.', NULL, NULL, 1, NULL),
(45, 'D042', 'wisata', 'Air Terjun Kertoimbo', 'Jalan menuju sebuah hidden games tentunya tidak akan mudah, jalanan yang dilalu sangat menantang adrenalin terutama para adventur. Jalanan berupa aspal halus sejauh 2 km kemudian disusul jalan dengan track batu sejauh 3 km jalan menuju ke atas dapat dilaju dengan kendaraan roda 4. Masih dipenuhi perpohonan besar, perkebunan kopi milik masyarakat sekitar, serta jurang. Ternyata jalan menuju air terjun kertoimbo masih terdapat pemukiman masyarakat yang asri. Mata kalian akan dimanjakan dengan pepohonan besar yang menyegarkan dimata serta air terjun yang airnya sangat segar. Disekitar Air Terjun Kertoimbo masih terdapat perkebunan kopi yang dikelola oleh seorang Sindren, beliau tinggal disebuah rumah yang disebut lodjie rumah tersebut sudah ada sejak Zaman Belanda dan masih berdiri kokoh hingga saat ini.', 'Kare, Madiun', 'terjunkertoimbo@gmail.com', '08977543526669', NULL, NULL, 1, 0, '2022-10-27 17:30:50', '2022-11-29 05:24:47', 'eMdOWL72yDfV9nrM3Hw0IHAguOMHX9k9HmkklpYv.jpg', 'tyfTOnFcQDZKkgIzfloh2Uk6pRf34PKGKSPpe2TK.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'air-terjun-kertoimbo', NULL, 'Dari pemerintah Kota Madiun ambil arah selatan menuju Jalan Pahlawan sejauh 50m lalu belok kiri sejauh 10m tetap di Jalan Pahlawan . Lalu belok kiri ke Jalan Perintis Kemerdekaan sejauh 400m dan belok kiri ke jalan Dr.Sutomo sejauh 300m . Belok kanan ke Jalan Diponegoro sejauh 1,3km . Setelah itu belok kanan ke Jalan Slamet Riyadi (melewati indoherma teknik (di kiri)) sejauh 1.9km . Setelah melewati Sinar Delima di sebelah kanan , belok kanan ke Jalan Tanjung Raya sekitar 1,1km . Nantinya ada arah ke kiri ke Jalan Dungus Manis / Jalan Raya Dungus sejauh 19km . Setelah itu belok kanan ke Jalan Raya Kandangan mengikuti jalan sejauh 1km dan setelah itu belok kiri sejauh 2,8km . Belok kanan tetap di Jalan Raya Kandangan sejauh 120m . Lalu belok kanan sejauh 1,9km dan setelah itu belok kiri sejauh 900m. Selanjutnya nanti belok kanan sejauh 750m dan lurus terus sejauh 800m nanti ada belok kanan sejauh 400m sampai tiba di Air Terjun Kertoimbo .', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.1084166924365!2d111.700295!3d-7.778327900000002!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79af0fdfc256ad%3A0xcff3bc8238b0c0c5!2sAir%20Terjun%20Kertoembo!5e0!3m2!1sid!2sid!4v1669871446708!5m2!1sid!2sid'),
(46, 'D043', 'wisata', 'Bumi Perkemahan Kandangan', 'Dusun Kandangan memiliki fasilitas berupa apangan luas dengan rumput hijau disertai bangunan. Tempat ini sering digunakan untuk kegiatan perkemahan pramuka oleh anak sekolah, biasanya dari wilayah ponorogo dan pacitan.', 'Kare, Madiun', 'buperkandangan@gmail.com', '0897034123785', NULL, NULL, 1, 0, '2022-10-27 17:34:26', '2022-11-29 05:26:15', 'vHiclX9teB4wwjWZTK5uBVrLvnhUoSLAJPhC7qbq.jpg', 'DjluE4iBBcTVSuzax2PvQtI55ZuFLycEtZnUOKei.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'bumi-perkemahan-kandangan', NULL, 'Dari pemerintah Kota Madiun ambil arah selatan menuju Jalan Pahlawan sekjauh 50m lalu belok kiri sejauh 10m tetap di Jalan Pahlawan . Lalu belok kiri ke Jalan Perintis Kemerdekaan sejauh 400m dan belok kiri ke jalan Dr.Sutomo sejauh 330m . Setelah itu belok kanan ke Jalan Slamet Riyadi (melewati indoherma teknik (di kiri)) sejauh 1.9km . Setelah melewati Sinar Delima di sebelah kanan , belok kanan ke Jalan Tanjung Raya sekitar 1,1km . Nantinya ada arah ke kiri ke Jalan Dungus Manis / Jalan Raya Dungus sejauh 19km . Setelah itu belok kanan ke Jalan Raya Kandangan mengikuti jalan sejauh 1km dan setelah itu belok kiri sejauh 2,8km. Belok kanan sejauh 120m tetap di Jalan Raya Kandangan . Lalu, belok kanan sejauh 1,9km dan ke kanan lagi sejauh 90m sampai di Bumi Perkemahan Kandangan.', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.3045142681535!2d111.6989053!3d-7.757492999999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afbad7e5e0f5%3A0x13234c3b2ded1588!2sBumi%20Perkemahan%20Kandangan!5e0!3m2!1sid!2sid!4v1669871703417!5m2!1sid!2sid'),
(47, 'D044', 'kuliner', 'Kripik Pisang & Jamu Instan', 'Owner dari umkm ini adalah Ibu Tris, beliau memulai usaha kripik pada tahun 2010 pada tahun 2014 beliau vakum berjualan dan memulai lagi pada tahun 2020 hingga saat ini. Pisang yang digunakan untuk membuat kripik adalah pisang kapok mentah. Selain usaha kripik pisang Ibu Tris juga menjual jamu instan siap seduh, jamu instan yang dijual adalah jamu beras kencur, jahe, kunyit, kunyit putih dan temulawak. Saat covid jualan jamu instan meningkat drastic, pemasaran dilakukan secara online dan terjual 3.000.000 bungkus dengan harga Rp. 10.000 per bungkus. Untuk hasil olahan kripik sudah dipasarkan ke toko pusat oleh-oleh dan warung makan seputar Kabupaten Madiun.', 'Kare, Madiun', 'umkmpisangjamu@gmail.com', '089754123098', NULL, NULL, 1, 0, '2022-10-27 17:37:36', '2022-11-29 06:22:22', 'sBHOTd4TgLCasWqS00lK3HJxwmu3oMoAJuNFudkt.jpg', 'QRLYw3e1M3eNoizEQHS9SOH5zamov9vA7porRMCf.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kripik-pisang-jamu-instan', NULL, NULL, NULL, NULL, NULL),
(53, 'D049', 'desa', 'Desa Wisata Kepel', 'Kepel adalah desa di kecamatan Kare, Madiun, Jawa Timur, Indonesia. Desa Wisata Kepel adalah desa dengan sejuta potensi dan masyarakatnya masih memegang adat serta menjaga kelestarian alam. Desa Kepel merupakan sentra perkebunan durian dan cengkeh. Namun, beberapa tahun ini sejak tahun 2013, masyarakat di Desa Kepel mulai tertarik untuk menanam tanaman Porang yang kini mereka juluki \"Berlian Hitam\' karena memiliki nilai ekonomi yang tinggi.', 'kepel, Madiun', 'kepel@gmail.com', '08121212', NULL, NULL, 1, 0, '2022-10-30 06:32:43', '2022-11-23 05:19:19', '88UvxGIIYbxcr83JoBFGwgNGmbkjChUtWdQ99C6f.jpg', 'tKtcb7Rn2fjPb0Hx85HavFsnDQW6gnrl7GYLi7eZ.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'desa-wisata-kepel', NULL, NULL, NULL, NULL, NULL),
(54, 'D050', 'desa', 'Desa Wisata Brumbun', 'Desa wisata Brumbun terletak di lereng gunung wilis,tepatnya di kab.Madiun,Jawa timur,dekat dengan kota Madiun,hanya 20 menit saja,kegiatan tubing/kelen adalah kegiatan awal,kemudian sekarang berkembang untuk kegiatan wisata edukasi,kegiatan dikelola oleh Pokdarwis Taruna Utama Brumbun dan berdiri sejak tahun 2016. Desa Brumbun Kecamatan Wungu Kabupaten Madiun terdapat sebuah desa wisata yang\r\nbertemakan adventure. Apabila anda suka berpetualang, silahkan berkunjung di desa brumbun. Disini terdapat wahana tubing, body rafting, air terjun, bermain di sungai, rumah pohon dan arena outbond. Selain menawarkan wahana permainan, desa brumbun juga menawarkan wisata edukasi bagi pelajar dan keluarga, seperti membuat kerajinan janur, membuat jajan tradisional, menanam padi dan menangkapikan di kolam.', 'brumbun', 'brumbun@gmail.com', '08121212', NULL, NULL, 1, 0, '2022-10-30 06:43:13', '2022-11-22 06:34:29', 'mc3rLBHN0eDnY8RZmsXHllWrtDI6pwVJl3a1LauT.jpg', 'ZnXWZD9fNYQlmK2nrgUd1OQsOaeTinfOOAf9TpBi.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'desa-wisata-brumbun', NULL, NULL, NULL, NULL, NULL),
(55, 'D015', 'wisata', 'Air Terjun Tambak Lare', 'Obyek wisata yang ada di Desa Kare yang mungkin patut dijadikan tujuan wisata akhir pekan kita . Masyarakat sekitar menyebutnya dengan nama Tambak Lare . Obyek wisata ini bisa menjadi alternatif bagi pecinta wisata alam. Obyek wisata Tambak Lare memiliki suasana alam yang masih terjaga keasriannya khas pedesaan .                                                \r\n\r\nSebelum kalian memasuki air terjun, kalian akan disuguhi tempat nongkrong untuk beristirahat. Setelah dari coffee shop kalian akan turun ke bawah dengan jalanan menurun bebatuan kurang lebih sejauh 1 km. Air terjun ini masih termasuk kawasan perkebunan kopi, jalan untuk menuju air terjun di gali sendiri oleh warga yang memudahkan kita untuk mengakses jalan. Kalian akan bertemu dengan pepohonan seperti pohon kemiri, pohon aren atau kolang kaling, dan beberapa pohon jati. Diarea air terjun juga terdapat camping ground yang dikelilingi oleh pohon pinus. Air terjunnya sendiri berbentuk seperti tangga dengan tinggi 6-8 meter. Jika kalian ingin berkunjung tempat ini tidak di kenai biaya masuk.', 'kare', 'kare@gmail.com', '08121212', NULL, NULL, 1, 0, '2022-10-30 09:03:52', '2022-11-29 05:28:21', 'XqXofqiZbmMDGLwkFZpBAU5oKi86tpFdYWbBFVwq.jpg', 'Kdn7SE1TgMeneGPTgm0I6Gozsocy0QSW6hjQaNEY.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'air-terjun-tambak-lare', NULL, 'Dari pemerintah Kota Madiun ambil arah selatan menuju Jalan Pahlawan sekjauh 50m lalu belok kiri sejauh 10m tetap di Jalan Pahlawan . Lalu belok kiri ke Jalan Perintis Kemerdekaan sejauh 400m dan belok kiri ke jalan Dr.Sutomo sejauh 330m . Setelah itu belok kanan ke Jalan Slamet Riyadi (melewati indoherma teknik (di kiri)) sejauh 1.9km . Setelah melewati Sinar Delima di sebelah kanan , belok kanan ke Jalan Tanjung Raya sekitar 1,1km . Nantinya ada arah ke kiri ke Jalan Dungus Manis /  Jalan Raya Dungus sejauh 19km . Setelah itu belok kanan ke Jalan Raya Kandangan mengikuti jalan sejauh 1km dan setelah itu belok kiri sejauh 2,1km sampai di Wisata Tambak Lare', NULL, 1, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.414765580487!2d111.6976658!3d-7.745754599999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79afc71946d915%3A0x4254a59851f2b2bf!2sWisata%20tambak%20lare!5e0!3m2!1sid!2sid!4v1669871925346!5m2!1sid!2sid'),
(56, 'D051', 'kuliner', 'Kopi Kare', 'Kopi Kare merupakan produk unggulan dari desa kare yang terletak di lereng gunung wilis, Kabupaten Madiun. Kopi Kare saat ini semakin dikenal oleh masyarakat Indonesia, khususnya di Jawa Timur. Budaya minum kopi sangat melekat pada masyarakat, oleh karena itu banyak cafe atau coffee shop kini menjual kopi yang berasal dari lereng gunung wilis ini. Kalau anda adalah pecinta kopi, maka anda perlu mencoba citarasa dari kopi ini. Kopi kare memiliki aroma yang tidak terlalu tajam tetapi tetap terasa khas kopi ini. Kopi kare ini dikelola oleh masyarakat setempat dengan memperkenalkannya sebagi kopi khas kabupaten Madiun yang menjadi produk unggulan. Berkumpul bersama akan terasa lebih nikmat jika ditemani oleh minuman yang satu ini, kopi kegiatan ini akan sangat pas bila sambil minum kopi. \r\n\r\nKopi kare saat ini juga sudah terkenal di beberapa provinsi di Indonesia, khususnya di Jawa Timur. Penjualan kopi kare juga terus diupayakan oleh pemerintah desa agar semakin dikenal dan meningkat setiap tahunnya. Pemerintah melalui desa kare, saat ini sangat terfokus dengan pemasaran produk  produk hasil UMKM dari desa kare.', 'kare', 'kopikare@gmail.com', '08121212', NULL, NULL, 1, 0, '2022-10-30 09:15:41', '2022-11-30 05:19:00', 'AUJ7GIVpBoXmBoaYWTrlPkEFFfXE8B7C5gpDSDgz.jpg', 'lHtcAXlRpiQh5LIRrWFasnU90uuzcZ9lRtOW4nKp.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kopi-kare', 'Kabupaten Madiun memiliki lahan subur untuk mengembangkan tanaman kopi di kawasan lereng Gunung Wilis, tepatnya di Desa Kare, Kecamatan Kare. Saat ini ada sekitar 55 hektare lahan di kawasan Kare yang ditanami pohon kopi.\r\nKetua Kelompok Tani Mugi Lestari Desa Kare, Madiun, Sumadi, mengatakan salah satu komoditas andalan Desa Kare adalah kopi Kare. Saat ini pihaknya sudah bisa memproduksi kopi yang sudah menjadi bubuk dan siap konsumsi.\r\n\r\nJadi, biji kopi yang dipanen dari perkebunan kami, kemudian diproses sendiri hingga menjadi bubuk kopi, kata dia beberapa waktu lalu.\r\n\r\nSumadi menuturkan kelompoknya sudah memiliki alat untuk mengolah biji kopi tersebut menjadi bubuk kopi. Kopi produksi para petani Kare ini pun sudah memiliki brand yaitu Kopi Kare.\r\n\r\nHasil menanam kopi yang cukup menguntungkan ini kemudian ditiru oleh para tetangganya. Pada awal penanaman kopi hanya ada tujuh petani saja yang menanam. Tetapi setelah hasilnya terlihat, kini ada 35 warga yang ikut terlibat dalam penanaman kopi.\r\nUntuk lahannya pun semakin luas. Menurut Sumadi pada awal-awal perintisan hanya sekitar 7 hektare saja, namun ini sudah mencapai 55 hektare. Warga memanfaatkan lahan hutan milik Perhutani untuk menanam kopi ini.\r\n\r\n\"Dari 55 hektare tersebut, yang baru bisa berbuah hanya sekitar 30 hektare saja. Sedangkan yang lain belum bisa berbuah,\" ujar dia.\r\n\r\nSumadi menuturkan Kopi Kare ini baru dijual berupa bubuk pada tahun 2017.', NULL, NULL, 1, 'https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d31626.177038753325!2d111.68513!3d-7.7609376!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79af42ff836161%3A0x18ebbfcbaf13f879!2sKopi%20Kare%20Madiun!5e0!3m2!1sid!2sid!4v1669871846874!5m2!1sid!2sid'),
(57, 'D040', 'wisata', 'Kesenian Jathilan', 'Salah satu kesenian khas Daerah Ponorogo juga dikembangkan di Desa Kare. Sanggar Seni Singo Mudho Manunggal salah satu sanggar yang menjadi tempat dikembangkannya Seni Ganong, Jathilan, dan Reog Ponorogo yang dikelola oleh Pak Dicky. Sebelum sanggar ini berdiri Pak Dicky melatih di TK Kare dan mengikuti paguyuban seni reog, karena lama kelamaan paguyuban itu sepi karena orang-orang mulai menghilang akhirnya beliau bertekat untuk membangun sanggar sendiri. Anggota sanggar ini adalah anak-anak usia 5 tahun sampai 11 tahun baik di Desa Kare maupun luar Desa Kare. Namun sanggar ini masih belum memiliki dadak merak sehingga saat ada job event beliau menyewa dari luar Daerah Madiun.', 'kare', 'kare@gmail.com', '08121212', NULL, NULL, 0, 0, '2022-10-30 09:53:47', '2022-10-30 09:54:46', 'SEr8vkRZjXHk2Tuq7zbUIukivYrrEa3u8qdzobwt.jpg', 'aOLCc9Cc6JX70hvXgOD8LGVkyAYy02Lzv8H6SJnq.jpg', NULL, NULL, NULL, NULL, '9', 0, 'LSuxdS8FYmLy3hYrPMzjH4bnosHo4NOV1MnIfza4.jpg', 'kesenian-jathilan', NULL, NULL, NULL, 1, NULL),
(58, 'D055', 'wisata', 'Contoh Event', NULL, 'Solo', 'contohevent@gmail.com', '081122223333', NULL, NULL, 0, 0, '2022-10-30 10:28:42', '2022-12-16 01:58:16', 'vFhmKkQWbBq7DRNRJszRvCLn2SUIDc3nhKqiVIIz.jpg', '3snXhacbRvbjEnfFwxZ2Q23uqAV0DfgTnqxtgfCl.jpg', NULL, NULL, NULL, NULL, '9', 0, 'LnE6Oqtd9G1wlC5RI5nm7LyskZQ8Jeg8NdXA5wXm.jpg', 'contoh-event', NULL, NULL, 'Arung jeram, camping, ATV', NULL, NULL),
(59, 'D056', 'penginapan', 'Homestay Desa Kare', 'Homestay yang terletak di Desa Kare, Madiun.', 'Desa Kare, Madiun', 'staydesakare@gmail.com', '0987654321123', NULL, NULL, 1, 0, '2022-11-11 03:55:28', '2022-12-01 04:38:50', 'qu8uN459FikK5aBsa4dfbMWar6PNwzNXLBiENXYJ.jpg', 'AOG3wIehry1ILaxORPTMmxC5PI5Hi43ij44FLS7B.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'homestay-desa-kare', 'Homestay yang terletak di Desa Kare, Madiun.', 'Mobil', 'Tidak ada', 1, NULL),
(60, 'D057', 'wisata', 'Rumah Singgah Soekarno', 'Rumah Singgah Soekarno Desa Kare, Madiun', 'Desa Kare, Madiun', 'rumahsinggah@gmail.com', '098765432123', NULL, NULL, 0, 0, '2022-11-11 10:55:33', '2022-11-18 02:59:43', '7vDKP6XkVCt4RYJl6wcvsmdT8j8n6X0soSPxgSY8.jpg', 'TGihR2JdpZcQV8U0zHbIHVfayQp2jO80cSuOCu56.jpg', NULL, NULL, NULL, NULL, '9', 0, 'qeZ3ieZ38N7TzjtjMbbMAQeko6WWqSAKvYUeFyzh.jpg', 'rumah-singgah-soekarno', NULL, NULL, NULL, NULL, NULL),
(61, 'D058', 'wisata', 'Hutan Pinus', 'Hutan Pinus Desa Kare, Madiun', 'Desa Kare, Madiun', 'hutanpinus@gmail.com', '098765432145', NULL, NULL, 0, 0, '2022-11-11 11:23:48', '2022-11-14 13:15:47', 'mc2roTTVMOe4u7W4Vp8LaWWiyAEAz6irspYKVI79.jpg', 'tgqkEU7rgDCdu0g1UimhCZRXXPzs3iVGdFADTYgR.jpg', NULL, NULL, NULL, NULL, '9', 0, 'mbMz3oZM0aWhU71PY6tACAjGsEtzDHLw2vjW5V4c.jpg', 'hutan-pinus', NULL, NULL, NULL, NULL, NULL),
(64, 'D061', 'wisata', 'Air Terjun Krecekan Danu', 'Air Terjun Krecekan Denu berada di Desa Kepel, Kecamatan Grape, Kabupaten Madiun. Ketinggiannya kurang lebih 15-20 meter dan debit airnya sangat bergantung pada curah hujan. Lokasi tempat wisata ini tidak jauh dari Wana Wisata Grape, kurang lebih 15 menit ke arah timur. Sehingga, setelah beriwasata di Grape, kita dapat sekalian mengunjungi Krecekan Denu ini.\r\n\r\n Krecekan Denu masih sangat alami dan asri. Akses jalan menuju air terjun ini mungkin agak sulit, tapi itu menjadi tantangan tersendiri bagi pengunjung. Setelah melewati pintu gerbang masuk, kita akan menyusuri tangga batu yang unik. Dan semua itu akan terbayar dengan suguhan keindahan yang tiada tara. Gemercik air terjun, suara kicauan burung burung, ditambah sapuan suara angin diantara pucuk-pucuk daun, sungguh keindahanyang tak mungkin tergantikan.', 'Desa Kepel, Kecamatan Kare, Kabupaten Madiun', 'krecekdanu@gmail.com', '0897723534447', NULL, NULL, 1, 0, '2022-11-22 05:39:49', '2022-11-23 07:06:37', 'vws9kY4xmVUxN7E83v4s61aGF5S7GIYlI1wrgPLA.jpg', 'AKQbl93rwJvNQazxZb4FhHKuebmIcSlcdkIYTP3X.jpg', NULL, NULL, NULL, NULL, '53', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'air-terjun-krecekan-danu', NULL, 'Destinasi wisata ini berjarak sekitar 18 km arah timur dari pusat kota Madiun.  Traveler yang ingin menikmati keindahan air terjun ini, dari Alun-Alun silakan mengambil ke arah menuju Dungus (kurang lebih jaraknya 12 kilometer). Setelah ketemu pasar Dungus, lanjut terus ke timur, nanti akan menemukan pertigaan, lalu ambil arah kanan ke arah Grape/Kresek. Setelah berjalan kurang lebih 500 meter, ada pertigaan ke arah Grape (dekat RS Paru), lalu belok ke kiri, melewati persawahan yang cantik dan bila hari cerah view Gunung Lawu akan terlihat sangat indah dalam perjalanan ini.', NULL, NULL, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d4047676.6368463687!2d110.4019256239589!3d-7.810010853789593!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79b00fffffffff%3A0x444a0da06d2a39f1!2sAir%20Terjun%20%22Krecek%20Ndenu%22!5e0!3m2!1sen!2sid!4v1669874080399!5m2!1sen!2sid'),
(65, 'D062', 'wisata', 'Air Terjun Banyu Lawe', 'Wisata Air Terjun Banyulawe adalah salah satu tempat wisata yang berada di Desa Kepel, Kecamatan Kare, Kabupaten Madiun. Tempat ini sangat indah dan bisa memberikansensasi yang berbeda saat mengunjunginya. Terletak di lereng pegunungan Wilis, dengan suasana dingin dan nuansa alam yang masih alami, anda akan dimanjakan dengan kenangan yang takterlupakan.\r\n\r\n Selain menyimpan keindahan alam, anda juga akan disambut senyum ramah penduduk sekitar air terjun.', 'Desa Kepel, Kecamatan Kare, Kabupaten Madiun', 'banyulawe@gmail.com', '089554312340', NULL, NULL, 1, 10000, '2022-11-22 05:45:55', '2023-01-11 07:34:06', 'SKHy7e9HV6sH0QJJ2SyZLVtsahQUP6eJgjyQ4TCN.jpg', '4I73NDsp7wrQB7CzaF64pi712KdvFarVr0MbMqb9.jpg', NULL, NULL, NULL, NULL, '53', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'air-terjun-banyu-lawe', 'Disebut Banyu Lawe mungkin kareana air terjun ini tampak melambai lambai jika di lihat dari kejauhan sehingga masyarakat setempat menamainya Air Terjun Banyu Lawe.', 'Air terjun Banyu Lawe  kurang lebih berjarak 20 km dari air terjun Krecekan Denu dan masuk daerah perbatasan antara Kecamatan Kare dan Kecamatan Ngebel,tepatnya di Dusn Gligi Desa Kepel Kecamatan Kare. Akses untuk menuju ke Air Terjun Banyu Lawe membutuh waktu 2 sampai 3 jam untuk sampai dilokasi tersebut.', NULL, NULL, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.2902897231734!2d111.68131071477791!3d-7.759006194407894!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79af9a073d3fd9%3A0x57ea65792461ccee!2sAir%20Terjun%20Banyulawe!5e0!3m2!1sen!2sid!4v1669874121605!5m2!1sen!2sid');
INSERT INTO `tb_tempat` (`id`, `user_id`, `kategori`, `name`, `deskripsi`, `alamat`, `email`, `telp`, `sosmed`, `galeri`, `status`, `htm`, `created_at`, `updated_at`, `image`, `image2`, `jambuka`, `jamtutup`, `gmaps`, `dana`, `induk_id`, `open`, `video`, `slug`, `sejarah`, `akses`, `atraksi`, `unggulan`, `lokasi`) VALUES
(66, 'D063', 'wisata', 'Taman Gligi Forest Park', 'Taman Gligi Forest Park berlokasi di Dusun Gligi, Desa Kepel, Kecamatan Kare, Kabupaten Madiun, Jawa Timur. la adalah sebuah tempat wisata yang berada di kawasan hutan di lereng Gunung Wilis yang menyuguhkan panorama alam pegunungan nan asri. Udara segar yang memasok aliran oksigen ke otak, warna hijau sejauh mata memandang yang mengendorkan otot-otot mata, menjadikan Gligi Forest Park tak hanya cukup untuk dikunjungi sejenak. Kurang rasanya jika lama kita berada disana disandarkan pada telah habisnya secangkir kopi murni asli Gligi yang disediakan oleh kedal disana.\r\n\r\n Dilengkapi dengan gazebo, spot foto, hingga taman bermain untuk anak-anak, memang kurang rasanya jika hanya sejenak. Namun tenang saja meskipun jam operasional Gligi Forest Park hanya dari pukul 08.30 - 16.30, menyadari keinginan pengunjung untuk berlama-lama disana, pihak pengelola juga menyediakan rumah pohon lengkap dengan kasur, bantal, dan selimut, serta camping ground bagi pengunjung yang ingin menginap. Bagi pengunjung yang berniat berkemah di sini perlu kiranya untuk membawa dan menyiapkan perlengkapannya secara mandiri, serta membayar Rp. 10.000-Rp. 30.000 untuk biaya administrasl dan konservasi. Untuk menuju lokasi disarankan kepada pengunjung membawa kendaraan roda dua, karena jalan yang tak begitu lebar, Kita semua tahu, tak ada surga yang tak tersembunyi.', 'Desa Kepel, Kecamatan Kare, Kabupaten Madiun', 'gligipark@gmail.com', '098745242889', NULL, NULL, 1, 0, '2022-11-22 05:48:24', '2022-11-23 07:24:00', 'gSFwrSEEyfa0DuobKbYjmRb4xVmrZLX4E719d4bs.jpg', 'rmWSzLCAhgyQnvIIRbugadcCByjhcWuQqbVfsqoh.jpg', NULL, NULL, NULL, NULL, '53', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'taman-gligi-forest-park', NULL, 'Buat kalian yang memulai perjalanan dari pusat kota Madiun, maka akan menghabiskan waktu tempuh sekitar 35 sampai 45 menit nantinya. Sepanjang perjalanan menuju Taman Gligi Forest Park Madiun, kamu bakal disuguhkan pemandangan berupa areal persawahan serta hutan yang bakal memanjakan mata kalian nantinya.', 'Taman Gligi Forest Park ini juga telah dilengkapi dengan berbagai spot, seperti salah satunya adalah keberadaan rumah Pohon seperti yang ada di berbagai tempat wisata lainnya', NULL, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d63252.47781183352!2d111.64057694467115!3d-7.760115168170449!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79af063b55e4b3%3A0x3eff993b61c6b63f!2sWISATA%20TAMAN%20GLIGI!5e0!3m2!1sen!2sid!4v1669873971016!5m2!1sen!2sid'),
(67, 'D066', 'desa', 'Desa Wisata Bodag', 'Desa Bodag Kecamatan Kare Kabupaten Madiun merupakan desa di lereng gunung wilis, wilayahnya berbatasan dengan hutan. Penduduknya bermata pencaharian bertani berkebun dan beternak\r\n\r\nTingkat pendidikan yg masih rendah serta mkjp yg renda serta wilayah yg berada di pinggiran membuat dusun butuh desa bodag masuk sebagai kampun KB', 'Desa Bodag , Kecamatan Kare', 'bodag@gmail.com', '081234556788', NULL, NULL, 1, 0, '2022-11-22 06:54:06', '2022-11-22 07:06:12', 'Swjrrfbov3kuL7gRv4pd4rKgnhNs088QNamgAiWn.jpg', 'a6dI6uuR7KjJVvim6BszExNkZya3C0UQ58mRmnHW.jpg', NULL, NULL, NULL, NULL, NULL, 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'desa-wisata-bodag', NULL, NULL, NULL, NULL, NULL),
(71, 'D070', 'wisata', 'Coba Wisata Kare', NULL, 'Kare, Madiun', 'msglowmagetan12@gmail.com', '09876543', NULL, NULL, 0, 20000, '2022-11-29 07:15:54', '2022-12-05 03:54:39', 'rcCJCgwLf5zHxk2ImVfgpoC92bqCTNkerOAtCJgT.jpg', 'RMjcwnTnrUnxkBi8h7BkjlBjX5tnga4eyPoAwvny.jpg', NULL, NULL, NULL, NULL, '9', 0, NULL, 'coba-wisata-kare', NULL, NULL, NULL, NULL, NULL),
(74, 'D077', 'penginapan', 'Aston Madiun Hotel', 'Berjarak hanya 4 menit berkendara dari Alun-Alun Kota Madiun, Aston Madiun Hotel & Conference Center adalah hotel bintang 4 elegan dengan kolam renang, pusat kebugaran dan fasilitas spa. Parkir umum di tempat tersedia gratis untuk para tamu hotel dan internet kabel tersedia di semua area umum.\r\n\r\nKamar-kamar ber-AC hotel ini didekorasi dengan bunga lili dan perabotan berwarna gelap, dilengkapi dengan minibar, area tempat duduk dan TV kabel layar datar. Setiap kamar juga memiliki meja dan fasilitas pembuat kopi/teh. Kamar mandi pribadi menyediakan pengering rambut, handuk dan perlengkapan mandi gratis.\r\n\r\nMenyajikan makanan Indonesia, Asia dan Amerika, H & E Restaurant menawarkan sarapan buffet, santapan a la carte sepanjang hari dan layanan kamar. Kamu bisa menggunakan fasilitas barbeku, sementara makanan anak tersedia dengan biaya tambahan. Para tamu bisa menikmati koktail di bar setelah makan malam, serta minuman espresso di kedai kopi.\r\n\r\nMengoperasikan resepsionis 24 jam, hotel ini membanggakan fasilitas rapat dan layanan concierge. Kamu bisa menggunakan layanan penitipan bagasi, ATM di lokasi, dan laundry. Para tamu yang sedang di hotel saja dapat menikmati jalan santai di taman.\r\n\r\nAston Madiun Hotel & Conference Center berjarak 2,8 km dari Plaza Madiun dan 2,1 km dari Taman Bantaran Kali Madiun, sedangkan Bunderan Serayu Taman Kota Madiun dapat dicapai dalam 6 menit berkendara dari hotel. Adi Soemarmo International Airport berjarak 121 km dan kamu bisa memesan layanan antar-jemput bandara berbayar dengan pihak properti.', 'Jl. Mayjend Sungkono No.41, Nambangan Kidul, Mangu Harjo, Kota Madiun, Jawa Timur 63128, Indonesia', 'astonhotel@gmail.com', '0987654321', NULL, NULL, 1, 0, '2022-11-29 13:45:46', '2023-02-22 08:44:33', 'W92aKN842JM8kgSb5aFn1q42ne4GnyzkF05OehCV.jpg', 'aNRH4L9aTWBF1WjbCrTeiXcoXm4xGbI6bdHpszYs.jpg', NULL, NULL, NULL, 8135000, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'aston-madiun-hotel', NULL, NULL, NULL, NULL, 'https://goo.gl/maps/Gs9mJpDBVLFXA7a39'),
(75, 'D078', 'penginapan', 'The Sun Hotel', 'Terletak hanya 7 menit berjalan kaki dari SunCity Water & Theme Park, The Sun Hotel Madiun menawarkan tempat menginap yang nyaman di jantung kota Madiun. Tamu yang menginap di hotel ini akan menemukan restoran, fasilitas rapat, dan pusat bisnis yang lengkap. Akses Wi-Fi gratis tersedia di seluruh area properti. \r\n\r\nMenampilkan interior kontemporer dengan lantai keramik, kamar-kamar ber-AC di The Sun Hotel Madiun menyediakan ruang yang nyaman untuk bersantai. Setiap kamar dilengkapi dengan TV kabel layar datar, area tempat duduk, dan jendela dengan pemandangan kota. Kamar mandi dalamnya menyediakan shower air panas dan dingin serta handuk dan perlengkapan mandi gratis. Beberapa kamar menawarkan ruang yang lebih besar untuk kenyamanan para tamu. \r\n\r\nAvalon Lounge hotel menyajikan sarapan prasmanan setiap hari dengan masakan Indonesia dan Barat. Para tamu juga dapat memilih makanan lezat dari layanan kamar berdasarkan permintaan. Selain itu, berbagai restoran dapat ditemukan di pusat perbelanjaan Plaza Madiun, yang hanya berjarak 10 menit berkendara. \r\n\r\nFasilitas lain yang tersedia di The Sun Hotel Madiun meliputi area lounge bersama dan parkir umum gratis di tempat bagi para tamu yang berkendara. Staf di meja depan 24 jam dapat membantu Anda dengan penitipan bagasi, akses ke pusat bisnis, dan permintaan binatu dengan biaya tambahan. \r\n\r\nPusat perbelanjaan SunCity Mall hanya berjarak 5 menit jalan kaki dari hotel. Stasiun Kereta Api Madiun dapat dicapai dalam 7 menit berkendara, sementara Bandara Internasional Adi Soemarmo di Solo akan memakan waktu sekitar 1,5 jam dengan mobil. Layanan antar-jemput bandara tersedia dengan biaya tambahan.', 'Kawasan Bisnis dan Rekreasi Suncity Festival Jl. Biarkan.Jend. S Parman No.8 Kec. Kel, Rejomulyo, Kec. Kartoharjo, Kota Madiun, Jawa Timur 63111', 'sunhotel@gmail.com', '0987654321', NULL, NULL, 1, 0, '2022-11-29 13:53:14', '2022-11-29 13:53:14', '9mY48oBYzP4VsQ1iBoQRNYnRuCMn1NyKkXVIMUkz.png', 'qrJC6DU3VYOjOmtM8Ug5mQI2sKKQvudqQEmtaltz.png', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'the-sun-hotel', NULL, NULL, NULL, NULL, 'https://g.page/thesunhotelmadiun?share'),
(78, 'D080', 'penginapan', 'Fave Hotel Madiun', 'Favehotel Madiun terdiri dari 60 kamar Superior yang baru dan modern, berukuran 18 m2 yang tersedia dengan ruangan merokok dan tidak merokok. Semua kamar dilengkapi televisi layar datar 32 inch, dengan 40 channel lokal dan internasional. Ruangan dilengkapi dengan pendingin udara, kamar mandi dengan desain menarik .', 'Manguharjo , Kota Madiun', 'favemadiun@gmail.com', '089652101019', NULL, NULL, 1, 0, '2022-11-30 05:58:49', '2022-11-30 05:58:49', 'gNSBtxxyTFIS6wk8iAeHlEJ9QlTUXcsY9gjXAaD8.jpg', 'nqc1RwLj2jDhDVWTBIy5OWwUWCzmbjLAJ88TIf1z.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'fave-hotel-madiun', NULL, 'favehotel Madiun terletak bersebelahan dengan Aston Madiun, tamu yang menginap di favehotel Madiun diperbolehkan memanfaatkan fasilitas rekreasi di Aston Madiun, letak favehotel Madiun juga dilalui kendaraan umum jalur propinsi. Dekat dengan pusat kuliner khas Madiun dan tempat oleh-oleh.', 'Salah satu hotel budget terbaik di Kota Madiun ,letak strategis. dekat dengan lokasi fasilitas umum dan pusat keramaian.', NULL, 'Jln Mayjend Sungkono No 43 Madiun, East Java, 63128'),
(79, 'D081', 'penginapan', 'Amaris Hotel Madiun', 'Madiun mungkin hanya kota kecil di Jawa Timur, tetapi, siapa sangka kota ini menyimpan banyak destinasi menarik. Melihat banyaknya wisatawan mencari alternatif destinasi wisata yang berbeda di Jawa Timur, Amaris Hotel Madiun hadir untuk memberikan akomodasi yang sesuai dengan kebutuhan. Amaris Hotel Madiun memberikan pilihan yang terjangkau dan tentu tidak melupakan kenyamanan dan keramahan pelayanannya.', 'Jl. Kalimantan No.30, Kartoharjo, Kec. Kartoharjo, Kota Madiun, Jawa Timur 63116', 'amarismadiun@gmail.com', '03514472525', NULL, NULL, 1, 0, '2022-11-30 06:12:47', '2022-11-30 06:12:47', 'CPvPqW5PLUgiNnKmzC2AZQ48ARn1OdsIzpUvPDY4.jpg', 'ExlLZEt952h6Qbaeonrzj0JAtt5zstkhBghgiCpP.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'amaris-hotel-madiun', 'Amaris Hotel adalah sebuah penginapan yang menyediakan kamar dan sarapan dengan harga terjangkau untuk pebisnis muda dan wisatawan yang menghargai nilai dari sebuah waktu dan uang. Amaris Hotel akan memberikan Anda pengalaman menelusuri keindahan dan kerberagaman pulau-pulau di Indonesia. Amaris Hotel menawarkan kamar yang segar, nyaman, dan bersih, ke mana pun Anda melangkah.', 'Amaris Hotel Madiun terletak di tengah kota yang dapat diakses mudah dengan kereta dari Surabaya dan Yogyakarta. Tamu dapat berjalan kaki 3 menit saja menuju Plaza Madiun dan 10 menit untuk ke Alun-Alun Madiun.', 'Di Amaris Hotel Madiun, kami menyediakan pilihan tempat pertemuan dan acara. Rencanakan pertemuan bisnis Anda, gathering atau pesta di Amaris Hotel Madiun.', NULL, 'https://goo.gl/maps/vXEJHvixfYqafkcu7'),
