(85, 'D086', 'penginapan', 'Hotel Merdeka Madiun', 'Hotel Bersejarah bintang 3 yang berada di pusat Kota Madiun', 'Manguharjo , Madiun', 'merdeka@gmail.com', '08123456789', NULL, NULL, 1, 0, '2022-12-01 03:18:07', '2022-12-22 04:35:24', 'CGnZl1CBsXNqZqNpVwFWMqlMEzNmP1JYTs12HRja.png', '70w8IdmSVJMbIMeZNOkP8j3uJ6AKthY163pLzjlr.png', NULL, NULL, NULL, 600000, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'hotel-merdeka-madiun', NULL, NULL, '\"Get The Satisfaction With Us\"', NULL, 'https://goo.gl/maps/azo4aWY1MANUCwPJA'),
(86, 'D087', 'wisata', 'Wana Wisata Selo Gedong', 'Selo yang berarti Batu, dan Gedong untuk Rumah Besar, itulah kiranya gambaran sekilas dari nama obyek wisata ini. Tatatan batu alam berukuran besar di puncak bukit, dengan panorama pemandangan yang eksotik, adalah daya tarik utama lokasi ini.  Tidak hanya menawarkan sebuah pesona panorama alam, terdapat pula kedai-kedai gazebo yang siap mengobatilapar dan dahaga pengunjung.\r\nDitemani rindang pohon pinus dengan kesegaran aromanya yang melapangkan dada, Selo Gedong menjadi tempat yang tidak akan membuat pengunjung jera untuk berkunjung kembali.', 'Desa Bodag, Kecamatan Kare, kabupaten madiun', 'selogedong@gmail.com', '089351243590', NULL, NULL, 1, 0, '2022-12-01 03:29:04', '2022-12-01 03:42:47', 'vIiH3yZ9mJ8ODfCx5rY84orlmhUGsDUy31fo1b8t.jpg', '4Wn3gApQiJoSULE1C3cwpeml7OmvhGlauktPCxvY.jpg', NULL, NULL, NULL, NULL, '67', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'wana-wisata-selo-gedong', NULL, 'Karena akses lokasi yang syarat akan kekhasan desa pegunungan, bagi para pengunjung disarankan untuk menggunakan kendaraan roda dua. Ini akan menjadi sebuah pengalaman mengasyikkan yang sayang untuk dilewatkan.', 'Terletak di Desa Bodag, Kecamatan Kare, Kabupaten Madiun, Selo Gedong merupakan sebuah fenomena geografis yang unik. Dari puncak terlihat Waduk Widas, Saradan yang berada di dekat perbatasan Madiun-Nganjuk.', NULL, 'https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3953.40207467501!2d111.66232571477785!3d-7.747106694416257!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e79a55f0aa49ae5%3A0xfdb644d459a75470!2sSELO%20GEDONG!5e0!3m2!1sid!2sid!4v1669873663867!5m2!1sid!2sid'),
(87, 'D088', 'penginapan', 'Hotel Kharisma Madiun', NULL, 'Jl. Dr. Sutomo No.35, Kartoharjo, Kec. Kartoharjo, Kota Madiun, Jawa Timur 63122', 'kharisma@gmail.com', '0351456708', NULL, NULL, 1, 0, '2022-12-01 03:38:14', '2022-12-05 07:29:28', 'MMzXdS2eSlfDw1oA1UTzvZ0APahODrWZeyik23YI.jpg', 'cb4qf7wtGFdVDEVT6qoKNKdcyaJ5GTdOcH2LPsxA.jpg', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'hotel-kharisma-madiun', NULL, NULL, NULL, NULL, 'https://goo.gl/maps/spkLZwNDS1ooXeff9'),
(88, 'D089', 'penginapan', 'Kali Catur Syariah Hotel', 'Kali Catur Syariah Hotel menawarkan penginapan modern di Madiun dengan jarak 10 menit berkendara dari Alun-Alun Kota Madiun. Selama menginap, kamu bisa menikmati fasilitas restoran, kolam renang outdoor, dan fasilitas rapat. Kamu juga bisa  menikmati akses WiFi gratis yang tersedia di seluruh area hotel. \r\n\r\nMenyuguhkan arsitektur Jawa tradisional dengan aksen kayu, kamar ber-AC di Kali Catur Syariah Hotel menyediakan ruangan yang nyaman untuk bersantai, serta dilengkapi dengan TV layar datar, area tempat duduk, dan jendela yang menghadap ke pemandangan halaman hotel. Di kamar mandi dalamnya terdapat shower air panas dan dingin, handuk, dan peralatan mandi gratis. Hotel ini juga menyediakan beberapa kamar dengan ruangan yang lebih luas untuk kenyamananmu.', 'Geger , Madiun', 'kalicatur@gmail.com', '081234567891', NULL, NULL, 1, 0, '2022-12-01 04:05:23', '2022-12-01 07:56:51', 'Ui3SegRbyJj6qBV6z7ditm25g8rVOhnsQudXpswA.png', 'SgpWCH9bcL2VOGvbJhRREsQQKdDPoMv1RM8Vhy5n.png', NULL, NULL, NULL, NULL, '9', 0, 'pKmCYqP4Bxq32cZ5Hb48Tl7EZvyNrX5Sz980QjYl.m4v', 'kali-catur-syariah-hotel', NULL, NULL, NULL, NULL, 'https://goo.gl/maps/FurCPqoDazGnFceT7'),
(89, 'D090', 'wisata', 'Air Terjun Coban Kromo', 'Air terjun Coban Kromo terletak di Desa Bodag , Kecamatan Kare , Kabupaten Madiun . Tempat ini merupakan salah satu wisata alam yang sangat eksotis .', 'Desa Bodag, Kecamatan Kare, Kabupaten Madiun', 'cbkromo@gmail.com', '0878293772834', NULL, NULL, 1, 0, '2022-12-01 07:47:03', '2022-12-05 03:39:05', 'tyTSPqUyc1TAuGMvQoOGewOn2hfNWjSxzgYT9VYu.jpg', '2DJYg3uB021l2c2gUS2RNb2czTlU5QbS59J1dnD9.jpg', NULL, NULL, NULL, NULL, '67', 0, '3n3s361qv2pPOXXhZbJv7LhIQfjgeDNlUm8gaQdJ.jpg', 'air-terjun-coban-kromo', 'Air Terjun Coban Kromo mempunyai dua aliran air terjun yang konon ceritanya merupakan dua jenis yang berbeda yakni laki - laki dan perempuan . Sehingga karena mitos tersebut , air terjun yang terletak di desa Bodag itu dinamakan Coban Kromo yang artinya air terjun berjodoh .', NULL, 'Kesederhanaan Coban Kromo saat ini , menawarkan pesona alam yang mempunyai daya tarik sendiri bagi para pecinta alam terlebih lagi Coban Kromo berada di area hutan yang pohonnya besar dengan kesejukan alam rimba yang masih asli dan asri .', NULL, NULL),
