(6, '14', '105', 'Aswin Loka', 'Berupa bangunan milik pribadi yang digunakan untuk kegiatan kesenian oleh masyarakat sekitar, tempat ini memiliki luas kurang lebih 3 hektar. Bentuk bangunan Aswin Loka sendiri seperti rumah pada umumnya namun terdapat tempat seperti sanggar dan ada gamelan selain itu tempat ini juga dijadikan tempat pertemuan-pertemuan penting seperti pertemuan dengan Dinas Pariwisata Kab. Madiun. Tempat ini masih asri dan memiliki keunikan seperti ditanamnya pohon kepel, pohon cendana, dan pohon nagasari. Dibuka untuk umum tanpa dipungut biaya serta menerima reservasi untuk pernikahan dan acara lainnya. Aswin Loka sendiri memiliki home stay yang bisa ditinggali oleh pengunjung yang ingin menginap. Sayangnya tempat ini belum begitu terjamah oleh masyarakat di luar Kabupaten Madiun. Dibelakang sanggar terdapat sebuah kendang besar yang berisi kijang dan merak, sekarang sudah dibebaskan kealam liar.', 'Branjang, Kare, Kec. Kare, Kabupaten Madiun, Jawa Timur', '081333882162', 'B2N93ySyhrw2I4rPeX77eCt817wqJis81zKAH157.jpg', 1, '2022-12-14 06:20:45', '2022-12-14 06:20:45');
