(1, 4, 'TS0001', 'Vila Delima', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.', 'Watu Gambir, Karanganyar', 'https://goo.gl/maps/XmTd7UTgtKAsRAgW6', '0271647658', '2PO8hnQFhFfqr3csut87tng1gcq6qwQgbhgAH8du.png', 1, 100000, '5', '2022-09-05 15:47:37', '2022-09-05 15:47:37'),
(2, 176, 'TS0002', 'Villa Kandangan', 'Villa yang berada Dusun Kandangan ini milik PT. Perusahaan Perkebunan Kandangan. Villa ini masih berdiri kokoh terawat dengan 84 kamar dan 2 tempat makan. Villa ini terbagi menjadi 8 bangunan. Villa ini di bangun pada tahun 2003 dan sering digunakan untuk event-event besar. Sebelum menjadi sebuah bangunan villa, tempat ini dulunya adalah sebuah perkebunan kopi milik pribadi dengan luas lahan 2.534 hektar ketika panen bisa mencapai hasil 200 ton kopi kare. Karena tempatnya yang jauh dari pusat kota, villa ini jarang dikunjungi.', 'Desa Kare, Madiun', 'https://maps.app.goo.gl/q6JsB95L1k28EXag8', '098765432122', 'swfpmjNhZHnePMFkzQ7Lix9nTH4yxFIZrBRnxpQe.jpg', 1, 200000, '4', '2022-10-27 07:48:40', '2022-11-07 04:21:12'),
(3, 263, 'TS0003', 'Villa 2', 'villa 2', 'kare', 'https://goo.gl/maps/cYhRoJx7AR7PkdnF6', '0987654321', 'BYtSKNxjhWgyagUyVdgHvnpaC8XexD5y1exLAs09.jpg', 1, 200000, '10', '2022-11-30 06:35:55', '2022-11-30 06:35:55');
